INSERT INTO `products` (`id`, `name`, `sku`, `price`, `is_discount`, `discount`, `image`, `description`, `category`, `created_at`, `updated_at`, `stock`, `tipe`, `categories`, `deleted_at`, `product_code`) VALUES
	(747, 'ASTHAROL TAB 4 MG', '55', '2500', b'0', 0, '55.jpg', '-', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 166, NULL, NULL, NULL, '24-ASTA4M-0001'),
	(748, 'LASAL TAB 4 MG', '454', '3500', b'0', 0, 'default_image.png', 'Lasal adalah obat yang digunakan untuk mengatasi asma, bronkitis kronis, penyakit obstruktif kronis, atau emfisema. Obat ini dapat meredakan keluhan, seperti sesak napas, mengi, dan batuk, akibat kondisi tersebut. Lasal tersedia dalam bentuk obat minum dan suntik dengan kandungan salbutamol.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 335, NULL, NULL, NULL, '24-LATA4M-0002'),
	(749, 'LASAL TAB 2 MG', '453', '2999.99', b'0', 0, 'default_image.png', 'Lasal 2 mg 10 Kapsul mengandung Salbutamol Sulfate. Salbutamol Sulfate adalah senyawa yang secara selektif merangsang reseptor beta-adrenergik pada otot polos bronkus, sehingga meningkatkan produksi AMP siklik dan mengaktifkan enzim adenil siklase yang menyebabkan relaksasi otot bronkus serta memperlebar saluran pernapasan. Obat ini digunakan untuk membantu meredakan kejang bronkus pada kondisi seperti asma bronkial, bronkitis kronis, dan emfisema dengan tujuan memperbaiki fungsi pernapasan melalui bronkodilatasi. Dalam penggunaan obat ini HARUS SESUAI PETUNJUK DOKTER.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 431, NULL, NULL, NULL, '24-LATA2M-0003'),
	(750, 'TEOSAL TAB', '896', '1500', b'0', 0, '896.jpg', 'Teosal Tablet adalah obat kombinasi yang mengandung Salbutamol (agonis beta-2) dan Theophylline (metilxantin). Obat ini digunakan untuk mengobati dan meringankan gejala bronkospasme pada pasien asma bronkial dan penyakit paru obstruktif kronis (PPOK). Obat ini tergolong Obat Keras (HARUS DENGAN RESEP DOKTER). Dalam pembelian, pasien akan diarahkan untuk mengikuti sesi edukasi singkat dengan Dokter kami mengenai penggunaan yang tepat dan aman. Informasi Umum Terkait Kandungan: Salbutamol bekerja cepat dengan merelaksasi otot polos bronkus. Theophylline memberikan efek bronkodilatasi tambahan melalui penghambatan enzim phosphodiesterase dan sebagai antagonis reseptor adenosin. Kombinasi ini bertujuan memberikan efek pelebaran saluran napas yang lebih kuat dan berkelanjutan.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 57, NULL, NULL, NULL, '24-TETA-0004'),
	(751, 'FORTI-D 400 IU SYR', '329', '35500', b'0', 0, '329.jpg', 'Forti D Sirup adalah suplemen kesehatan, digunakan untuk membantu memenuhi kebutuhan vitamin D, terutama pada kondisi tertentu seperti lanjut usia, ibu hamil/menyusui, penderita infeksi, autoimun, atau risiko tinggi kekurangan vitamin D. Kandungan utama: Vitamin D3 (cholecalciferol).', 25, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 18, NULL, NULL, NULL, '25-FO40IU-0005'),
	(752, 'CHOLESTOR FC TAB 20 MG', '181', '8500', b'0', 0, '181.jpg', 'Cholestor 20 mg adalah obat keras digunakan untuk menurunkan kadar kolesterol jahat (LDL) dan trigliserida serta meningkatkan kolesterol baik (HDL). Obat ini hanya boleh digunakan dengan resep dokter karena termasuk golongan statin. Aturan pakai : Malam sebelum tidur Kandungan : Atorvastatin Calcium 20 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 25, NULL, NULL, NULL, '24-CHFCTA-0006'),
	(753, 'CHOLESTOR FC TAB 10 MG', '180', '6000', b'0', 0, '180.jpg', 'Cholestor 10 mg adalah obat yang digunakan untuk menurunkan kolesterol jahat (LDL), trigliserida, serta meningkatkan kolesterol baik (HDL). Aturan pakai : Malam hari sebelum tidur Kandungan : Atorvastatin Calcium 10 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 110, NULL, NULL, NULL, '24-CHFCTA-0007'),
	(754, 'ZYGOUT KAPLET', '1358', '12500', b'0', 0, '1358.jpg', 'Zygout 80 mg adalah obat resep yang digunakan untuk menurunkan kadar asam urat dalam darah pada pasien dengan hiperurisemia kronis (penyakit gout). Obat ini diberikan terutama pada pasien yang tidak cocok atau tidak merespons terapi dengan allopurinol. Aturan pakai : Sesudah makan Kandungan : Febuxostat 80 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 121, NULL, NULL, NULL, '24-ZYKA-0008'),
	(755, 'KOLSIN TAB', '1343', '4499.99', b'0', 0, 'default_image.png', 'Kolsin 0,5 mg merupakan obat yang digunakan untuk mengobati atau mencegah serangan gout (kadar asam urat tinggi dalam darah). Dalam penggunaan obat ini harus SESUAI DENGAN PETUNJUK DOKTER. Aturan pakai : Sesudah makan Kandungan : Cholchicine 0,5 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 49, NULL, NULL, NULL, '24-KOTA-0009'),
	(756, 'BENOXURIC TAB 100MG', '70', '3500', b'0', 0, '70.jpg', 'Benoxuric adalah obat lini utama untuk mengontrol kadar asam urat pada pasien gout dan hiperurisemia. Obat ini efektif mencegah serangan berulang. Karena termasuk obat keras, penggunaannya harus dengan resep dan pengawasan dokter. Aturan pakai : Sesudah makan Kandungan : Allopurinol 100 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 210, NULL, NULL, NULL, '24-BETA10-0010'),
	(757, 'BENOXURIC TAB 300MG', '71', '5500', b'0', 0, '71.jpg', 'Benoxuric adalah obat lini utama untuk mengontrol kadar asam urat pada pasien gout dan hiperurisemia. Obat ini efektif mencegah serangan berulang. Karena termasuk obat keras, penggunaannya harus dengan resep dan pengawasan dokter. Aturan pakai : Sesudah makan Kandungan : Allopurinol 300 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 155, NULL, NULL, NULL, '24-BETA30-0011'),
	(758, 'PROMUCIL EFF', '701', '109000', b'0', 0, 'default_image.png', 'Promucil adalah obat digunakan sebagai mukolitik untuk membantu mengencerkan dahak pada saluran pernapasan. Obat ini juga memiliki manfaat tambahan sebagai antidotum (penawar) pada keracunan parasetamol. Aturan pakai : Sesudah makan, Larutkan dalam 1 gelas air Kandungan : N-acetylcysteine/NAC', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '24-PREF-0012'),
	(759, 'INTUNAL FORTE TAB', '405', '1999.99', b'0', 0, '405.jpg', 'Intunal-F tablet merupakan obat untuk meringankan gejala flu seperti demam, sakit kepala, hidung tersumbat dan bersin-bersin yang disertai batuk. Aturan pakai : Sesudah makan, Kandungan : Pct 500 mg, PPA HCl 15mg, Dexchlorpheniramine maleat 2mg, Dextrometorphan HBr 15mg, GG 50mg', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 368, NULL, NULL, NULL, '26-INFOTA-0013'),
	(760, 'L-ACYS CAPS', '436', '5500', b'0', 0, '436.jpg', 'L-ACYS digunakan untuk mengobati penyakit pada saluran napas yang ditandai dengan hipersekresi mukus (dahak) pada kondisi bronkitis akut atau kronis, emfisema paru, dan bronchieactasis. Aturan pakai : Sesudah makan, Kandungan : N-acetylcysteine', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 644, NULL, NULL, NULL, '24-LACA-0014'),
	(761, 'GLYCERYL GUAIACOLATE TAB', '352', '1000', b'0', 0, '352.jpg', 'GUAIFENESIN/ GLYCERYL GUAIACOLATE TABLET merupakan obat jenis ekspektoran yang dapat meredakan batuk dan melancarkan pengeluaran dahak di saluran napas. Obat ini bekerja dengan cara meningkatkan volume dahak dan membuatnya lebih encer sehingga lebih mudah dikeluarkan dari saluran pernapasan melalui jalur nafas dengan proses batuk.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 305, NULL, NULL, NULL, '26-GLGUTA-0148'),
	(762, 'DOSIVEC CAPS 300 MG', '247', '6000', b'0', 0, '247.jpg', 'Dosivec adalah obat untuk meredakan batuk berdahak, bantu mengatasi keluhan pada kondisi bronkitis kronis atau bronkitis akut. Aturan pakai : Sesudah makan, Kandungan : Erdostein 300mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1043, NULL, NULL, NULL, '24-DOCA30-0016'),
	(763, 'RHINOS SR', '1287', '9500', b'0', 0, '1287.jpg', 'Rhinos SR adalah obat yang digunakan untuk mengatasi gejala alergi rhinitis, seperti bersin, mukokonstipasi, rhinorhoea, dan pruritus nasal. Obat ini direkomendasikan ketika diperlukan efek antihistamin dan efek dekongestan. Aturan pakai : Sesudah makan, Kandungan : Loratadine 5mg, pseudoefedrin hcl 120mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 406, NULL, NULL, NULL, '24-RHSR-0017'),
	(764, 'EFLIN TAB', '259', '2500', b'0', 0, '259.jpg', 'Eflin adalah obat untuk meringankan gejala flu, pilek, dan alergi, seperti bersin-bersin, hidung meler maupun tersumbat, atau mata berair. Aturan pakai : Sesudah makan, Kandungan : Triprolidine 2,5 mg, pseudoefedrin 60mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1232, NULL, NULL, NULL, '24-EFTA-0018'),
	(765, 'LAMESON 8MG TAB', '445', '10500', b'0', 0, '445.jpg', 'Lameson 8 mg 10 Tablet mengandung Methylprednisolone. Methylprednisolone merupakan obat kortikosteroid sistemik yang digunakan untuk menekan reaksi peradangan dan alergi yang berat pada berbagai kondisi medis. Informasi Umum Terkait Kandungan: Methylprednisolone adalah glukortikosteroid sintetis yang bekerja sebagai agen anti-inflamasi dan imunosupresif. Obat ini bekerja dengan meniru dan memperkuat efek hormon kortikosteroid alami tubuh, dengan cara masuk ke dalam sel dan menghambat produksi berbagai mediator peradangan (seperti prostaglandin dan leukotrien). Mekanisme ini secara efektif mengurangi gejala-gejala peradangan seperti pembengkakan, kemerahan, dan nyeri, serta menekan reaksi sistem imun yang berlebihan pada penyakit autoimun.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1281, NULL, NULL, NULL, '24-LA8MTA-0019'),
	(766, 'PRODEXON TAB', '694', '1500', b'0', 0, '694.jpg', 'PRODEXON 0.5 MG 10 TABLET mengandung Dexamethasone 0.5 mg sebagai zat aktif. Obat ini termasuk dalam golongan kortikosteroid sintetis yang memiliki aktivitas anti-inflamasi dan imunosupresif. Dexamethasone diindikasikan untuk penanganan berbagai kondisi yang memerlukan efek anti-inflamasi dan penekanan sistem kekebalan tubuh, seperti alergi berat, gangguan peradangan (misalnya artritis reumatoid, asma bronkial), dan kondisi medis lain sesuai dengan resep dokter. Mekanisme kerjanya adalah dengan menekan respons inflamasi tubuh dan modulasi respons imun.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1212, NULL, NULL, NULL, '24-PRTA-0020'),
	(767, 'MEPROSON TAB 4 MG', '520', '4499.99', b'0', 0, '520.jpg', 'MEPROSON 4 adalah obat yang mengandung Methylprednisolone, suatu glukokortikoid sintetik turunan prednisolon. Obat ini memiliki efek antiinflamasi dan imunosupresif yang poten. Mekanisme kerjanya melibatkan ikatan dengan reseptor glukokortikoid intraseluler, yang setelah teraktivasi akan berikatan dengan daerah promotor DNA. Proses ini memodulasi transkripsi gen, baik mengaktivasi maupun menekan ekspresi gen tertentu, termasuk melalui deasetilasi histon, sehingga mengakibatkan penurunan produksi mediator inflamasi. PREDNICORT secara klinis diindikasikan untuk penanganan berbagai kondisi alergi dan inflamasi yang memerlukan terapi glukokortikoid, seperti pada penyakit autoimun, gangguan pernapasan, serta kondisi dermatologis dan reumatologis.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1712, NULL, NULL, NULL, '24-META4M-0021'),
	(768, 'SULCOLON TAB', '860', '10500', b'0', 0, '860.jpg', 'SULCOLON merupakan antiinflamasi yang mengandung Sulfasalazine. Obat ini digunakan untuk meredakan gejala radang usus atau kolitis ulseratif, seperti nyeri perut, demam, diare, atau pendarahan di usus besar. Selain itu, obat ini dapat digunakan untuk rheumatoid arthtitis (RA), yaitu radang kronis pada sendi. Informasi Umum Terkait Kandungan: Sulfasalazine bekerja dengan cara menghambat sintesis prostaglandin sehingga tidak terjadi respon sakit.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 57, NULL, NULL, NULL, '24-SUTA-0022'),
	(769, 'FRESHCARE STRONG', '333', '16000', b'0', 0, '333.jpg', 'Minyak angin aromaterapi', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '27-FRST-0023'),
	(770, 'PANADOL EXTRA/STRIP', '644', '15000', b'0', 0, '644.jpg', 'Panadol Extra merupakan obat yang digunakan untuk meredakan demam dan rasa nyeri atau sakit kepala. Panadol Extra mengandung zat aktif Paracetamol (Acetaminophen) yaitu zat aktif yang memiliki aktivitas sebagai penurun demam/antipiretik dan pereda nyeri/analgesik yang bekerja dengan cara menghambat pembentukan prostaglandin yaitu zat yang memicu nyeri dan demam di hipotalamus untuk meningkatkan pelepasan panas supaya suhu tubuh normal. Dikombinasikan dengan kafein yang berfungsi untuk mencegah rasa kantuk.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 9, NULL, NULL, NULL, '27-PAEX-0024'),
	(771, 'PANADOL/STRIP', '645', '13500', b'0', 0, '645.jpg', 'PANADOL BIRU TABLET 1 STRIP memiliki kandungan bahan aktif Paracetamol. Paracetamol bekerja dengan cara mengurangi kadar prostaglandin di dalam tubuh, sehingga tanda peradangan seperti demam dan nyeri akan berkurang. Obat ini digunakan untuk meringankan rasa sakit seperti sakit kepala, sakit gigi serta menurunkan demam. Paracetamol dapat dikonsumsi sesudah makan. Konsultasikan terlebih dahulu kepada dokter apabila akan digunakan pada pasien dengan kondisi: Riwayat alergi terhadap kandungan obat ini. Pasien dengan penyakit gangguan hati berat. Pasien yang mengonsumsi alkohol dapat meningkatkan potensi kerusakan hati. Pasien dengan penyakit gangguan ginjal.Interaksi dapat terjadi apabila digunakan bersamaan dengan obat-obatan seperti:  Metoclopramide dapat meningkatkan efek analgetic paracetamol. Paracetamol meningkatkan efek obat warfarin. Carbamazepine meningkatkan potensi kerusakan hati.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 8, NULL, NULL, NULL, '27-PA-0025'),
	(772, 'DULCOLAX TAB /STRIP ISI 4', '253', '12000.01', b'0', 0, '253.jpg', 'Dulcolax merupakan obat pencahar yang menginduksi gerakan usus dan melunakkan feses sehingga membantu melancarkan proses Buang Air Besar (BAB) serta mengosongkan usus dari kotoran sebelum dilakukan kolonoskopi atau operasi. Dulcolax mengandung zat aktif Bisakodil yaitu obat turunan metana jenis stimulan yang bekerja dengan merangsang saraf enterik sehingga mengakibatkan kontraksi pada usus besar pada saat mengeluarkan feses sekaligus membersihkan atau mengosongkan isi di dalam usus besar', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 24, NULL, NULL, NULL, '27-DUTAST-0026'),
	(773, 'TOLAK ANGIN DEWASA', '907', '5000', b'0', 0, '907.jpg', 'Tolak Angin Cair Plus Madu merupakan obat herbal terstandar yang bermanfaat untuk mengatasi masuk angin dengan gejala seperti mual, kembung, pusing, badan meriang dan terasa lemas.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 8, NULL, NULL, NULL, '27-TOANDE-0027'),
	(774, 'MYCORINE CREAM 5GR', '564', '30000', b'0', 0, '564.jpg', 'MYCORINE CREAM 5 GR adalah sediaan topikal antijamur golongan imidazol yang efektif digunakan untuk mengatasi infeksi jamur pada kulit. Produk ini mengandung Miconazole Nitrate 2%, yang bekerja dengan menghambat biosintesis ergosterol pada jamur, komponen penting pada membran sel jamur, sehingga mengganggu integritas membran dan menyebabkan nekrosis sel jamur. Krim ini secara umum diindikasikan untuk pengobatan berbagai kondisi infeksi kulit yang disebabkan oleh fungi seperti Trichophyton, Epidermophyton, Microsporum, Candida, dan Malessezia furfur. Contoh infeksi yang dapat ditangani meliputi tinea pedis (kutu air), tinea cruris (gatal pada selangkangan), tinea corporis (kurap), dan kandidiasis kulit.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 15, NULL, NULL, NULL, '27-MYCR5G-0028'),
	(775, 'SANMOL FORTE TAB 650 MG', '771', '1500', b'0', 0, '771.jpg', 'Obat yang mengandung Paracetamol dengan dosis 650 mg. Obat ini digunakan untuk meredakan nyeri seperti sakit kepala, sakit gigi, dan menurunkan demam. Informasi umum terkait kandungan: Obat ini bekerja secara sentral di pusat pengatur suhu dan nyeri di otak. Komposisi Tiap tablet mengandung Paracetamol 650 mg.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 851, NULL, NULL, NULL, '27-SAFOTA-0029'),
	(776, 'NULOSE SYR 120 ML', '617', '99500', b'0', 0, '617.jpg', 'NULOSE SYR 120 ML adalah sirup pencahar yang mengandung bahan aktif Lactulose, digunakan untuk mengobati sembelit (konstipasi) kronis dan kondisi gangguan fungsi otak akibat gagal hati (ensefalopati portal-sistemik). Lactulose bekerja dengan menarik cairan ke usus, melunakkan feses, dan mengubah keasaman usus, serta membantu menekan pertumbuhan bakteri berbahaya sambil meningkatkan bakteri baik.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 8, NULL, NULL, NULL, '27-NUSY12-0030'),
	(777, 'MADU MURNI NUSANTARA 650ML', '482', '159000', b'0', 0, '482.jpg', 'Nusantara Madu Murni 650 Ml berkhasiat untuk kesehatan tubuh. Meningkatkan stamina dan daya tahan tubuh. Meredakan demam, batuk, pilek, sakit kepala, panas dalam, sariawan, bibir pecah-pecah, radang tenggorokan, amandel, menjaga kesehatan kulit, Nutrisi bergizi bagi ibu hamil dan menyusui.', 28, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '28-MAMUNU-0031'),
	(778, 'MICROLAX GEL', '534', '27000', b'0', 0, '534.jpg', 'Microlax adalah obat pencahar berbentuk gel yang digunakan untuk mengatasi sembelit dengan cara melunakkan dan mempermudah pengeluaran feses. Informasi Umum Terkait Kandungan: Natrium Lauril Sulfat adalah surfaktan yang melunakkan tinja. Natrium Sitrat bertindak sebagai pelunak tinja. Sorbitol adalah osmotik laksatif yang menarik air ke dalam usus. Kombinasi ini bekerja secara sinergis dalam hitungan menit untuk melunakkan tinja dan memicu gerakan usus, sehingga mempermudah buang air besar tanpa menyebabkan kram yang parah.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '27-MIGE-0032'),
	(779, 'CALADINE POWDER ORIGINAL 100G', '114', '21500', b'0', 0, '114.jpg', 'CALADINE POWDER ORIGINAL 100 G merupakan bedak tabur untuk mengurangi gatal-gatal karena biang keringat. Komposisi : Calamine, Zinc oxide, Camphor, Menthol', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 5, NULL, NULL, NULL, '27-CAPOOR-0033'),
	(780, 'SANMOL TAB 500 MG', '773', '1500', b'0', 0, '773.jpg', 'Obat dengan kandungan Paracetamol 500 mg. - Obat ini digunakan untuk meringankan rasa sakit pada keadaan sakit kepala, sakit gigi dan menurunkan demam.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 839, NULL, NULL, NULL, '27-SATA50-0034'),
	(781, 'MEVITON TAB', '531', '2500', b'0', 0, '531.jpg', 'Meviton merupakan multivitamin yang dapat membantu meningkatkan stamina dan menjaga daya tahan tubuh supaya tidak mudah jatuh sakit.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 488, NULL, NULL, NULL, '27-META-0035'),
	(782, 'MYCONIX SALEP 10 GR', '1384', '81499.99', b'0', 0, 'default_image.png', 'adalah salep antijamur untuk infeksi kulit seperti ruam popok, kurap, kutu air, dan jamur pada lipatan kulit, menggabungkan Nystatin (antijamur) dan Zinc Oxide (pelindung kulit), bekerja membunuh jamur dan mencegah iritasi, harus dengan resep dokter karena termasuk obat keras.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '24-MYSA10-0036'),
	(783, 'L-VIT D3 5000 IU', '438', '6000', b'0', 0, '438.jpg', 'L-Vit D3 merupakan obat dengan kandungan zak aktif Cholecalciferol (vitamin D3) 5000 IU dalam bentuk soft kapsul yang mempunyai efek kerja sebagai mencegah kekurangan vitamin D, membantu meningkatkan daya tahan tubuh, mengatasi dan mencegah osteoporosis, serta mengatasi hipoparatiroid, rakitis, dan hipofosfatemia.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 494, NULL, NULL, NULL, '27-LVD350-0037'),
	(784, 'HICAL TAB', '371', '2500', b'0', 0, '371.jpg', 'Vitamin yang mengandung Calcium carbonate, vitamin D3, magnesium oksida, zn sulfat, natrium florida untuk memenuhi kebutuhan kalsium dan vitamin d3 pada anak dan ibu hamil', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 0, NULL, NULL, NULL, '27-HITA-0038'),
	(785, 'CAL-95 CAPLET', '112', '9500.01', b'0', 0, '112.jpg', 'Cal-95 1100 mg adalah suplemen yang bermanfaat sebagai terapi tambahan untuk mengatasi osteoporosis. Cal-95 1100 mg merupakan suplemen kalsium yang dilengkapi dengan soy isoflavone serta vitamin dan mineral lain yang juga mendukung kesehatan tulang. Suplemen ini dapat digunakan untuk mendukung kesehatan tulang pada kelompok yang membutuhkan lebih banyak kalsium atau yang berisiko mengalami osteoporosis, seperti wanita pasca menopause, lansia, atau pengguna kortikosteroid.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 100, NULL, NULL, NULL, '27-CACA-0039'),
	(786, 'FOLAVIT 1000 MCG TAB', '323', '3500', b'0', 0, '323.jpg', 'Mencegah dan mengatasi kekurangan asam folat, terutama pada penderita anemia megaloblastik, ibu hamil, atau ibu menyusui. Mengandung asam folat 1000 mcg', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 256, NULL, NULL, NULL, '27-FO10MC-0040'),
	(787, 'PROMAVIT TAB', '699', '6500', b'0', 0, '699.jpg', 'suplemen mineral dan vitamin yang memberi manfaat dalam memelihara kesehatan ibu hamil dan menyusui. Kandungan: Vitamin A 345 IU, Vitamin B12 0.5 mcg, Vitamin B6 150 mcg, Vitamin D3 34.5 IU, Asam lemak omega 3 64.5 mg, Minyak ikan tuna 179 mg, Fe fumarat 23.5 mg, DHA 48.5 mg, EPA 12.5 mg, Asam folat 400 mcg, Magnesium oksida 62.5 mg, Kalsium karbonat 100 mg', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 181, NULL, NULL, NULL, '27-PRTA-0041'),
	(788, 'THROMBOPHOB OINT 15GR', '901', '61500', b'0', 0, '901.jpg', 'THROMBOPHOB OINTMENT merupakan salep dengan kandungan zat aktif Heparin Sodium dan Asam Nikotinat Bezylester. Heparin merupakan suatu antikoagulan yang dapat mencegah terbentuknya gumpalan-gumpalan dalam darah dan membantu memcahkan pembekuan darah yang telah terbentuk. Obat ini digunakan unutk mengatasi memar, trombosis permukaan, tromboflebitis, kaku kedinginan, koreng kaki, radang selaput dada (pleuritis), kejang betis, tendovaginitis, bisul, menghilangkan haematomata, mencegah dan mengobati radang pembuluh balik setelah penyuntikan intravena dan infiltrat setelah injeksi paravenous, pencegahan ulkus dekubital dan perawatan setelah amputasi. Komposisi : Setiap 100 gram mengandung 5000 IU Sodium Heparin, 0.25 gram Asam Nikotinat Bezylester.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '27-THOI15-0042'),
	(789, 'FG TROCES', '24-FGTR-0043', '0', b'0', 0, '24-FGTR-0043.jpg', 'Tablet hisap yang bermanfaat untuk mengatasi infeksi bakteri pada rongga mulut, seperti radang tenggorokan atau sariawan. neomycin sulfate (fradiomycin sulfate) 2,5 mg dan gramicidin 1 mg.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 0, NULL, NULL, NULL, '24-FGTR-0043'),
	(790, 'APIALYS SYRUP', '37', '58999.99', b'0', 0, '37.jpg', 'APIALYS SIRUP adalah suplemen kesehatan yang diformulasikan untuk membantu memenuhi kebutuhan multivitamin pada anak, terutama dalam masa pertumbuhan. Produk ini mengandung kombinasi berbagai vitamin esensial seperti Vitamin A, Vitamin D, Vitamin B Kompleks (B1, B2, B6, B12, Nicotinamide, Dexpanthenol), dan Vitamin C, serta dilengkapi dengan asam amino L-Lysine dan L-Glutamic Acid untuk membantu melengkapi asupan nutrisi harian anak. Informasi Umum Terkait Kegunaan Vitamin yang Terkandung* : *(Informasi ini bersifat edukatif dan tidak dimaksudkan sebagai klaim manfaat langsung dari produk ini di luar indikasi utamanya) Vitamin A & D: Membantu menjaga kesehatan mata, serta pertumbuhan tulang dan gigi. Vitamin B Kompleks (B1, B2, B3, B6, B12, Dexpanthenol): Membantu dalam proses metabolisme untuk menghasilkan energi dan menjaga kesehatan sistem saraf. Vitamin C: Sebagai antioksidan yang membantu melindungi sel tubuh dan mendukung fungsi sistem kekebalan tubuh. L-Lysine & L-Glutamic Acid: Sebagai asam amino yang penting untuk pertumbuhan jaringan. L-Lysine juga membantu menjaga nafsu makan yang baik pada anak. Komposisi : Tiap 5 ml sirup mengandung: Vitamin A 5.000 IU Vitamin D3 400 IU Thiamine hydrochloride (Vitamin B1) 3 mg Riboflavin (Vitamin B2) 2 mg Pyridoxine hydrochloride (Vitamin B6) 6 mg Cyanocobalamin (Vitamin B12) 5 mcg Nicotinamide (Vitamin B3) 20 mg Ascorbic Acid (Vitamin C) 50 mg Dexpanthenol 5 mg L-Lysine monohydrochloride 250 mg L-Glutamic Acid 25 mg', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 31, NULL, NULL, NULL, '27-APSY-0044'),
	(791, 'SIRPLUS SYRUP STRAWBERRY 100 ML', '826', '19500', b'0', 0, '826.jpg', 'SIRPLUS SIRUP RASA STRAWBERRY 100 ML adalah sirup pemanis (flavoring syrup) yang diformulasikan khusus untuk membantu mempermudah pemberian obat. Sirup ini dirancang sebagai pelarut atau campuran untuk menutupi rasa pahit obat, terutama obat puyer (serbuk). Informasi Umum Terkait Kandungan: Produk ini adalah Sirupus Simplex (sirup gula sederhana) yang telah diberi perasa stroberi yang disukai anak-anak. Fungsi utamanya adalah sebagai pelarut (vehicle) dan pemanis (sweetener). Dengan mencampurkan obat puyer yang pahit ke dalam sirup ini, rasa obat yang tidak enak dapat tersamarkan, sehingga memudahkan anak untuk mengonsumsi obatnya dengan tuntas. Komposisi : Gula (Sukrosa), Glukosa, Perisa Strawberry, Air.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 52, NULL, NULL, NULL, '27-SISYST-0045'),
	(792, 'SIRPLUS SYRUP ANGGUR 100 ML', '823', '19500', b'0', 0, '823.jpg', 'Sirplus Sirup Anggur merupakan sirup yang berfungsi sebagai pelarut dan pemanis campuran obat. Anda bisa campurkan Sirplus Sirup Anggur dengan obat puyer yang harus dikonsumsi anak, agar anak tak merasakan cita rasa pahit dari obat tersebut. Komposisi : Gula Alami, Sirup Rasa Anggur', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 100, NULL, NULL, NULL, '27-SISYAN-0046'),
	(793, 'SIRPLUS SYRUP MELON 100 ML', '825', '19500', b'0', 0, '825.jpg', 'Sirplus Sirup Melon merupakan sirup yang berfungsi sebagai pelarut dan pemanis campuran obat. Anda bisa campurkan Sirplus Sirup Melon dengan obat puyer yang harus dikonsumsi anak, agar anak tak merasakan cita rasa pahit dari obat tersebut. Komposisi : Gula, Air, Perisa melon, Pengental Karboksimetil Selulosa, Pengawet Natrium Benzoat, Pewarna makanan', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 35, NULL, NULL, NULL, '27-SISYME-0047'),
	(794, 'SANMOL SYR 60 ML', '772', '23000', b'0', 0, '772.jpg', 'SANMOL SIRUP merupakan obat dengan kandungan Paracetamol. Obat ini digunakan untuk meringankan rasa sakit pada keadaan sakit kepala, sakit gigi dan menurunkan demam. Sanmol bekerja pada pusat pengatur suhu di hipotalamus untuk menurunkan suhu tubuh (antipiretik) serta menghambat sintesis prostaglandin sehingga dapat mengurangi nyeri ringan sampai sedang (analgetik).', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 23, NULL, NULL, NULL, '33-SASY60-0048'),
	(795, 'MUCOS DROP 20 ML', '555', '47000', b'0', 0, '555.jpg', 'Mucos Drops 20 Ml bermanfaat untuk mengatasi batuk berdahak dan gangguan pernapasan lain akibat produksi dahak yang berlebihan. Mucos Drops 20 Ml membantu mengencerkan dahak agar lebih mudah dikeluarkan dari tenggorokan saat batuk. Dengan begitu, saluran pernapasan lebih terbuka dan terasa lega. Komposisi : Per-mL : Ambroxol HCl 15 mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 7, NULL, NULL, NULL, '24-MUDR20-0049'),
	(796, 'SUPRALYSIN SYR 100ML', '869', '41000', b'0', 0, '869.jpg', 'Supralysin Sirup 100 Ml merupakan kombinasi multivitamin dan Lysine, yang terdiri dari Vitamin B-complex, Vitamin A, Vitamin D, Vitamin C dan Lysine. Komposisi : Vitamin B-complex, Vitamin A, Vitamin D, Vitamin C dan Lysine.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 5, NULL, NULL, NULL, '27-SUSY10-0050'),
	(797, 'BIOCOMBIN FC TAB', '93', '2500', b'0', 0, '93.jpg', 'Biocombin mengandung vitamin B kompleks yang dapat digunakan untuk membantu pengobatan defisiensi vitamin B kompleks seperti halnya penyakit beri-beri, polineuritis alkoholik dan anemia pernisiosa. Mengandung 100mg thiamine monohidrate, 200mg pyridoxine HCl, dan 200mcg cyanocobalamine', 30, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 276, NULL, NULL, NULL, '30-BIFCTA-0051'),
	(798, 'MALTIRON PLUS TAB', '487', '2500', b'0', 0, '487.jpg', 'Mencegah kekurangan zat besi dan vitamin B pada wanita hamil dan menyusui di masa pemulihan. Mengandung Fe Glukonat, Vit-B1, Vit-B2, Vit-B6, nikotinamid, biotin', 30, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 238, NULL, NULL, NULL, '30-MAPLTA-0052'),
	(799, 'AQUABIDEST 25 ML', '33-AQ25ML-0053', '4499.99', b'0', 0, '33-AQ25ML-0053.jpg', 'Aquabidest 25ml adalah air murni ganda (double distilled water) dengan kemurnian sangat tinggi, dihasilkan dari penyulingan dua kali (bidestilasi) yang menghilangkan mineral dan zat lain. Kandungan utamanya adalah H2O (Air Murni)', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 473, NULL, NULL, NULL, '33-AQ25ML-0053'),
	(800, 'L-BIO SACHET', '437', '13500', b'0', 0, '437.jpg', 'L-Bio 30 Sachet adalah obat yang digunakan untuk melindungi sistem pencernaan dan memperbaiki fungsi normal saluran pencernaan ketika mengalami kondisi diare, konstipasi dan penggunaan antibiotika jangka panjang pada bayi, anak-anak ataupun dewasa. Komposisi : Rice starch, Maltodextrin, Lactobacillus Acidophilus, Lactobacillus Casei, Lactobacillus Salivarius, Bifidobacterium Infantis, Bifidobacterium Lactis, Bifidobacterium Longum, Lactococcus Lactis', 31, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 268, NULL, NULL, NULL, '31-LBSA-0054'),
	(801, 'KASA ROLL 10CM/1PIECE', '1310', '5500', b'0', 0, '1310.jpg', 'Kasa Roll 10cm/1piece adalah gulungan kain kasa lebar 10 cm yang digunakan untuk membalut luka, menyerap cairan, dan menahan perban, biasanya terbuat dari bahan hidrofil berdaya serap tinggi tanpa sambungan untuk menjaga kebersihan luka.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 41, NULL, NULL, NULL, '32-KARO10-0055'),
	(802, 'DERMAFIX T 10X15', '1307', '8500', b'0', 0, '1307.jpg', 'plester luka transparan, steril, kedap air, dan breathable (memungkinkan kulit bernapas) dengan ukuran 10x15 cm, dilengkapi bantalan penyerap cairan, berfungsi melindungi luka besar atau pasca operasi (seperti caesar) dari bakteri sambil tetap memungkinkan aktivitas mandi dan menjaga kelembaban kulit.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 8, NULL, NULL, NULL, '32-DET10-0056'),
	(803, 'KSR 600MG TAB', '435', '6500', b'0', 0, '435.jpg', 'suplemen kalium yang bermanfaat untuk mengobati dan mencegah kekurangan kalium.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 74, NULL, NULL, NULL, '24-KS60TA-0057'),
	(804, 'INTERLAC TAB', '404', '15500', b'0', 0, '404.jpg', 'Interlac adalah suplemen probiotik untuk memelihara kesehatan fungsi saluran pencernaan pada bayi baru lahir hingga orang dewasa. Bila sistem pencernaan sehat, penyerapan nutrisi akan lebih optimal, buang air besar teratur, dan daya tahan tubuh kuat sehingga tidak mudah sakit. Komposisi : Tiap tablet kunyah mengandung : Lactobacillus reuteri (Lactobacillus reuteri DSM 17938) 100.000.000 CFU', 30, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 21, NULL, NULL, NULL, '30-INTA-0058'),
	(805, 'ZIRCUM KID TAB', '997', '2500', b'0', 0, '997.jpg', 'Suplemen selama diare, diberikan bersama dengan cairan rehidrasi oral, pada anak. Mengandung Zinc Sulfate', 30, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 375, NULL, NULL, NULL, '30-ZIKITA-0059'),
	(806, 'COMBES FC TAB', '30-COFCTA-0060', '5499.99', b'0', 0, '30-COFCTA-0060.jpg', 'Combes merupakan tablet dengan kombinasi chitosan, ekstrak garsinia cambogia, L-carnitine, chromium picolinat, coenzime Q10 dan vitamin C yang dapat membantu mengurangi lemak tubuh. Komposisi : Chitosan 250 mg, ekstrak garcinia Cambogia 250 mg, L-carnitine 50 mg, Chromium Picolinate 50 mcg, fermented Co-enzyme Q10 10 mg, Vit.C 25 mg', 30, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 75, NULL, NULL, NULL, '30-COFCTA-0060'),
	(807, 'ULTRAFIX 10CMX1M', '924', '10500', b'0', 0, '924.jpg', 'plester penutup luka steril berbahan kain non-woven yang lembut, fleksibel, dan berpori, digunakan untuk menempelkan kasa atau penutup luka lain, melindungi luka dari kotoran, serta membantu sirkulasi udara agar luka cepat kering dan sembuh', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 29, NULL, NULL, NULL, '32-UL10-0061'),
	(808, 'HY-FOLIC TAB', '372', '6000', b'0', 0, '372.jpg', 'Membantu memenuhi kebutuhan asam folat. Tiap kaplet salut selaput mengandung: (6S)-5-Methyltetrahydrofolic Acid, Glucosamine Salt (Quatrefolic) 1.100 mcg (setara dengan 550 mcg 5-MTHF atau folat aktif)', 31, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 62, NULL, NULL, NULL, '31-HYTA-0062'),
	(809, 'MASKER NEBULIZER DEWASA', '498', '34000', b'0', 0, 'default_image.png', 'Masker nebulizer dewasa adalah alat medis sekali pakai berbentuk masker untuk pasien dewasa, berfungsi menghirup obat cair yang diubah jadi uap oleh mesin nebulizer, terbuat dari PVC medis, dilengkapi wadah obat dan selang untuk mengantarkan kabut obat langsung ke saluran pernapasan, membantu mengatasi masalah pernapasan seperti asma atau sesak napas.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 46, NULL, NULL, NULL, '32-MANEDE-0063'),
	(810, 'MASKER NEBULIZER ANAK', '497', '34000', b'0', 0, 'default_image.png', 'Masker nebulizer aNAK adalah alat medis sekali pakai berbentuk masker untuk pasien anak, berfungsi menghirup obat cair yang diubah jadi uap oleh mesin nebulizer, terbuat dari PVC medis, dilengkapi wadah obat dan selang untuk mengantarkan kabut obat langsung ke saluran pernapasan, membantu mengatasi masalah pernapasan seperti asma atau sesak napas.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 26, NULL, NULL, NULL, '32-MANEAN-0064'),
	(811, 'MINYAK TELON CAPLANG 60 ML', '545', '20000', b'0', 0, 'default_image.png', 'Minyak telon dengan sensasi hangat yang pas untuk bayi yang baru lahir. Dibuat dari bahan alami agar si kecil tetap sehat dan nyaman.', 28, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '28-MITECA-0065'),
	(812, 'MEFIX TAB 500 MG', '510', '2500', b'0', 0, '510.jpg', 'obat yang mengandung asam mefenamat, digunakan untuk meredakan nyeri ringan hingga sedang, seperti sakit kepala, nyeri otot, dan nyeri haid.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 871, NULL, NULL, NULL, '24-META50-0066'),
	(813, 'MAGANOL 500MG TAB', '486', '1500', b'0', 0, '486.jpg', 'Obat ini dapat digunakan untuk mengatasi nyeri akibat sakit kepala, sakit gigi, radang sendi, atau nyeri menstruasi. Obat dengan kandungan aktif paracetamol ini juga bermanfaat untuk menurunkan demam. Mengandung Paracetamol 500 Mg', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 71, NULL, NULL, NULL, '27-MA50TA-0067'),
	(814, 'MINYAK TELON CAPLANG 30 ML', '544', '11500', b'0', 0, '544.jpg', 'Minyak telon dengan sensasi hangat yang pas untuk bayi yang baru lahir. Dibuat dari bahan alami agar si kecil tetap sehat dan nyaman.', 28, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '28-MITECA-0068'),
	(815, 'BETADINE GARGLE 190 ML', '74', '44500', b'0', 0, '74.jpg', 'BETADINE GARGLE 190 ML adalah obat kumur antiseptik dengan kandungan Povidone Iodine 1%, berfungsi untuk mengatasi masalah mulut seperti sakit tenggorokan, sariawan, gusi bengkak, bau mulut, dan napas tidak segar dengan membunuh bakteri dan jamur penyebab infeksi. Cara pakai, tuang 15 ml (seukuran tutup botol), kumur 30-60 detik, 3-5 kali sehari, lalu buang. Komposisi : Povidone Iodine 1%', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '26-BEGA19-0069'),
	(816, 'BUFECT TAB', '107', '1500', b'0', 0, '107.jpg', 'obat yang mengandung Ibuprofen 200 Mg. Digunakan untuk membantu mengatasi demam, nyeri, dan peradangan, termasuk sakit kepala, nyeri otot, sakit gigi, nyeri punggung, nyeri menstruasi, hingga arthritis.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 70, NULL, NULL, NULL, '26-BUTA-0070'),
	(817, 'BETADINE VAGINAL DOUCHE 100 ML+APLICATOR', '76', '145500', b'0', 0, '76.jpg', 'BETADINE VAGINAL DOUCHE 100 ML+APLICATOR adalah antiseptik kewanitaan dengan kandungan utama Povidone Iodine 10% untuk mengatasi gejala iritasi, gatal, dan keputihan akibat bakteri atau jamur (seperti Trichomonas vaginalis, Candida albicans), serta berfungsi sebagai disinfektan area kewanitaan, tersedia dengan aplikator untuk memudahkan penggunaan dengan mencampur cairan dan air hangat sesuai petunjuk dokter untuk terapi atau pembersihan rutin. Komposisi : Povidone Iodine 10%', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-BEVADO-0071'),
	(818, 'EZERRA CREAM 25 GR', '282', '102000', b'0', 0, '282.jpg', 'EZERRA CREAM merupakan pelembab kulit yang memberi manfaat mengurangi gejala kulit kering dan sensitif serta dapat digunakan pada dewasa, anak, maupun bayi. Kandungan argan oil, shea butter, dan spent grain wax pada produk ini membantu menghambat proses peradangan dan alergi di epidermal kulit. Sedangkan kandungan saccharide Isomerate untuk menarik dan mempertahankan kelembaban kulit, sehingga efektif mengatasi keluhan kulit kering, gatal, dan kemerahan.', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '33-EZCR25-0072'),
	(819, 'ARM SLING SIZE M', '45', '35500', b'0', 0, 'default_image.png', 'Arm Sling Ukuran M adalah penyangga lengan untuk cedera bahu, siku, atau patah tulang, berfungsi membatasi gerakan agar cepat sembuh, menjaga posisi, dan memberikan dukungan, biasanya terbuat dari bahan nyaman seperti non-woven agar sirkulasi udara lancar, dan cocok untuk orang dewasa dengan ukuran lengan sedang.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '32-ARSLSI-0073'),
	(820, 'BIOPLACENTON GEL 15 GR', '95', '38000', b'0', 0, '95.jpg', 'BIOPLACENTON GEL 15G merupakan obat yang memiliki kandungan Placenta Extract dan Neomycin Sulfate. Obat ini digunakan untuk mengobati luka bakar, luka dengan infeksi, serta luka kronik dan jenis luka yang lain.', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '33-BIGE15-0074'),
	(821, 'ARM SLING SIZE S', '46', '35500', b'0', 0, 'default_image.png', 'Arm Sling Ukuran S adalah penyangga lengan untuk cedera bahu, siku, atau patah tulang, berfungsi membatasi gerakan agar cepat sembuh, menjaga posisi, dan memberikan dukungan, biasanya terbuat dari bahan nyaman seperti non-woven agar sirkulasi udara lancar.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '32-ARSLSI-0075'),
	(822, 'ARM SLING SIZE L', '44', '35500', b'0', 0, 'default_image.png', 'Arm Sling Ukuran L adalah penyangga lengan untuk cedera bahu, siku, atau patah tulang, berfungsi membatasi gerakan agar cepat sembuh, menjaga posisi, dan memberikan dukungan, biasanya terbuat dari bahan nyaman seperti non-woven agar sirkulasi udara lancar.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '32-ARSLSI-0076'),
	(823, 'ARM SLING XL', '47', '35500', b'0', 0, 'default_image.png', 'Arm Sling Ukuran XL adalah penyangga lengan untuk cedera bahu, siku, atau patah tulang, berfungsi membatasi gerakan agar cepat sembuh, menjaga posisi, dan memberikan dukungan, biasanya terbuat dari bahan nyaman seperti non-woven agar sirkulasi udara lancar.', 32, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '32-ARSLXL-0077'),
	(824, 'X-CAM TAB 7,5 MG', '988', '7500', b'0', 0, '988.jpg', 'obat untuk meredakan nyeri dan peradangan. Obat berbahan aktif meloxicam ini bermanfaat untuk mengatasi keluhan pada penyakit akibat peradangan sendi, seperti osteoarthritis dan rheumatoid arthritis. Mengandung Meloxicam 7,5 Mg', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 25, NULL, NULL, NULL, '24-XCTA75-0078'),
	(825, 'BURNAZIN CREAM 35GR', '108', '95500', b'0', 0, '108.jpg', 'BURNAZIN CREAM adalah obat yang mengandung Silver Sulfadiazine. Obat ini digunakan untuk mengobati atau mencegah infeksi pada luka bakar yang rentan terhadap infeksi sekunder.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-BUCR35-0079'),
	(826, 'SPASMOLIT FC TAB', '838', '3500', b'0', 0, '838.jpg', 'Obat antispasmodik yang mengandung hyoscine butylbromide, digunakan untuk meredakan kram perut dan masalah pencernaan lainnya.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 240, NULL, NULL, NULL, '24-SPFCTA-0080'),
	(827, 'EFLAGEN 50 MG TAB', '1322', '3500', b'0', 0, '1322.jpg', 'Obat yang digunakan untuk meredakan nyeri atau peradangan misalnya akibat cedera, terkilir, atau pascaoperasi gigi dan tulang. Obat ini juga sering digunakan untuk mengatasi nyeri, bengkak, dan kaku pada radang sendi, seperti rheumatoid arthritis.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 132, NULL, NULL, NULL, '24-EF50MG-0081'),
	(828, 'MYORES TAB', '568', '6500', b'0', 0, '568.jpg', 'MYORES 2 MG mengandung tizanidine yang berfungsi untuk mengobati kejang-kejang pada otot yang disebabkan oleh kondisi tertentu (seperti multiple sclerosis, cedera tulang belakang). Obat ini bekerja dengan mengendurkan otot.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 433, NULL, NULL, NULL, '24-MYTA-0082'),
	(829, 'OCIDERM N CREAM 5 GR', '622', '38000', b'0', 0, '622.jpg', 'OCIDERM N CR 5G memiliki kandungan bahan aktif Fluocinolone acetonide dan Neomycin sulfate yang digunakan untuk mengatasi peradangan pada kulit yang disertai dengan infeksi bakteri, dan ditandai dengan perubahan pada kulit. Komposisi : Tiap gram krim mengandung Fluocinolone Acetonide 0.025% dan Neomycin Sulfate 5 mg.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 14, NULL, NULL, NULL, '24-OCNCR5-0083'),
	(830, 'NUSCAB CR 30 GR', '618', '99500', b'0', 0, '618.jpg', 'Nuscab krim adalah obat untuk mengatasi infeksi parasit di kulit, seperti kutu di rambut kepala dan kutu kelamin, hingga kudis. Krim yang mengandung permethrin ini efektif untuk membasmi parasit penyebab infeksi dan meredakan gejalanya. Nuscab krim termasuk dalam kelompok obat antiparasit. Obat oles ini mampu melumpuhkan saraf dan otot-otot pernapasan dari parasit penyebab infeksi. Berkat kemampuan Nuscab krim, parasit penyebab infeksi tidak dapat berkembang biak dan akhirnya mati. Hasilnya, infeksi parasit beserta gejalanya akan mereda.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-NUCR30-0084'),
	(831, 'SODERMIX CREAM 15GR', '830', '115500', b'0', 0, '830.jpg', 'Sodermix cream merupakan krim yang mengandung ekstrak solanum likopersikum 2%. Sodermix cream bekerja dengan mengurangi sintesis dan sekresi sitokin serta extraxelluar matrix proteins, sehingga dapat menekan pruritus yang sering dikaitkan dengan keloid dan bekas luka hiperpropis, dapat juga mengurangi peradangan yang muncul. Sodermix cream secara bertahap mampu meratakan, menghaluskan, melembutkan bekas luka. Jika terjadi iritasi, kemerahan, dan nyeri hentikan pemakaian dan segera konsultasi kepada dokter.', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '33-SOCR15-0085'),
	(832, 'TUDERM CREAM 5GR', '918', '15500', b'0', 0, '918.jpg', 'TUDERM N CR 5G adalah obat yang digunakan untuk mengobati penyakit kulit seperti manifestasi inflamasi dan pruritus pada psoriasis resisten atau berat dan dermatosis yang peka terhadap obat golongan kortikosteroid. Tuderm N cream mengandung Betamethasone, obat yang termasuk golongan kortikosteroid, dan neomycin sulfate, obat yang termasuk antibiotik golongan aminoglikosida.', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 5, NULL, NULL, NULL, '33-TUCR5G-0086'),
	(833, 'VISANCORT CREAM 10 GR', '970', '20000', b'0', 0, '970.jpg', 'Visancort adalah obat untuk mengobati penyakit kulit, seperti jerawat, eksim, dermatitis, dan penyakit kulit lain yang peka terhadap kortikosteroid.Obat ini mengandung hydrocortisone, golongan kortikosteroid yang bekerja dengan mengurangi reaksi sistem kekebalan tubuh berlebihan terhadap peradangan. Pada akhirnya, gejala akibat peradangan tersebut bisa mereda.Selain kandungan kortikosteroid untuk meredakan masalah pada kulit, Visancort juga mengandung iodochlorohydroxyquinoline dan camphor.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 12, NULL, NULL, NULL, '24-VICR10-0087'),
	(834, 'CENTABIO GEL 20 GR', '171', '34500', b'0', 0, '171.jpg', 'CENTABIO GEL 20 G adalah obat yang digunakan untuk membantu penyembuhan luka bakar, borok kronis, dan cacat kulit yang disertai infeksi bakteri tertentu. Centabio mengandung neomycin yang bekerja dengan cara mengikat secara reversibel terhadap sub unit 30s dari ribosom bakteri sehingga menghambat sintesa protein yang pada akhirnya menghambat pertumbuhan bakteri itu.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 9, NULL, NULL, NULL, '24-CEGE20-0088'),
	(835, 'SAGESTAM CREAM 10 GR', '756', '19000', b'0', 0, '756.jpg', 'SAGESTAM 0.1% SALEP merupakan sediaan topikal berbentuk salep yang digunakan untuk mengobati penyakit kulit akibat infeksi oleh bakteri yang peka. Sagestam mengandung Gentamicin yang termasuk golongan antibiotik aminoglikosida yang digunakan secara luas terutama untuk mengobati infeksi-infeksi yang disebabkan oleh bakteri gram negatif, seperti Pseudomonas, Proteus, Serratia, dan Staphylococcus. Gentamicin juga digunakan untuk septikemia (keracunan darah oleh bakteri patogenik dan atau zat-zat yang dihasilkan oleh bakteri tersebut), meningitis (radang selaput otak), infeksi saluran kemih, saluran pernafasan, saluran pencernaan, infeksi pada kulit, tulang, dan jaringan lunak', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 49, NULL, NULL, NULL, '24-SACR10-0089'),
	(836, 'LICOVIR CREAM 5 G', '462', '8000', b'0', 0, '462.jpg', 'Licovir adalah obat oles untuk mengatasi infeksi virus herpes simpleks di bibir maupun alat vital. Dengan menggunakan obat ini, ruam lepuh atau luka terbuka akibat herpes dapat sembuh lebih cepat. Licovir terbuat dari bahan aktif acyclovir. Bahan tersebut menghambat produksi enzim tertentu yang dibutuhkan virus herpes untuk memperbanyak diri. Dengan cara kerja tersebut, jumlah virus herpes di kulit bisa terkendali dan dapat dilawan oleh sistem kekebalan tubuh.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 17, NULL, NULL, NULL, '24-LICR5G-0090'),
	(837, 'ELOX CR 5GR', '262', '65499.99', b'0', 0, '262.jpg', 'ELOX 0.1% CREAM 10 G digunakan untuk mengobati kondisi kulit seperti eksim (bengkak dan kemerahan pada kulit), psoriasis (peradangan kronis pada kulit), alergi, dan ruam.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 37, NULL, NULL, NULL, '24-ELCR5G-0091'),
	(838, 'KLODERMA OINT 5GR', '431', '33000', b'0', 0, '431.jpg', 'Kloderma adalah obat yang bermanfaat untuk meredakan gejala peradangan pada kulit, seperti ruam, gatal, kemerahan, dan bengkak. Beberapa penyakit radang kulit yang bisa diatasi dengan Kloderma adalah eksim, psoriasis, dermatitis, lichen planus, atau lupus.Kloderma mengandung bahan aktif clobetasol dengan kadar 0,05%. Obat oles ini mampu mengaktifkan zat alami di dalam kulit yang bisa mengurangi gejala akibat peradangan.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-KLOI5G-0092'),
	(839, 'PIROFEL GEL', '666', '27500', b'0', 0, '666.jpg', 'PIROFEL adalah gel yang mengandung Piroxicam 0.5%. Piroxicam merupakan golongan obat Anti-Inflamasi Non Steroid (AINS) yang bekerja dengan cara menghambat kerja enzim siklooksigenase-1 (COX-1). Enzim ini berfungsi membantu pembentukan prostaglandin saat luka yang menyebabkan rasa sakit dan peradangan. Dengan terhalanginya kerja enzim COX-1, enzim prostaglandin diproduksi lebih sedikit. Oleh karena itu, rasa sakit dan peradangan dapat berkurang.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '24-PIGE-0093'),
	(840, 'NEBACETINE POWDER 5 GR', '584', '34000', b'0', 0, '584.jpg', 'NEBACETIN POWDER adalah obat antibiotik topikal dalam bentuk serbuk tabur. Produk ini digunakan untuk mencegah dan mengobati infeksi kulit superfisial (permukaan) yang disebabkan oleh bakteri. Obat ini bekerja melalui kombinasi sinergis dari dua antibiotik. Neomycin Sulfate adalah antibiotik golongan aminoglikosida yang bekerja dengan menghentikan produksi protein esensial yang dibutuhkan bakteri untuk bertahan hidup dan berkembang biak; utamanya efektif melawan bakteri Gram-negatif. Sementara itu, Bacitracin bekerja dengan merusak dan menghambat pembentukan dinding sel, yaitu lapisan pelindung vital bagi bakteri, sehingga bakteri tidak dapat bertahan dan akan mati; utamanya efektif melawan bakteri Gram-positif. Kombinasi keduanya memberikan spektrum aksi yang luas untuk menargetkan berbagai jenis bakteri yang umum ditemukan pada infeksi kulit.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '24-NEPO5G-0094'),
	(841, 'NEBACETIN OINT 5GR', '583', '31500', b'0', 0, '583.jpg', 'NEBACETIN SALEP adalah obat antibiotik topikal yang digunakan untuk mencegah dan mengobati infeksi bakteri pada kulit. Obat ini bekerja melalui kombinasi sinergis dari dua antibiotik. Neomycin Sulfate adalah antibiotik golongan aminoglikosida yang bekerja dengan menghentikan produksi protein esensial yang dibutuhkan bakteri untuk bertahan hidup dan berkembang biak; utamanya efektif melawan bakteri Gram-negatif. Sementara itu, Bacitracin bekerja dengan merusak dan menghambat pembentukan dinding sel, yaitu lapisan pelindung vital bagi bakteri, sehingga bakteri tidak dapat bertahan dan akan mati; utamanya efektif melawan bakteri Gram-positif.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-NEOI5G-0095'),
	(842, 'LUSANOC TAB', '478', '6500', b'0', 0, '478.jpg', 'Lusanoc adalah obat untuk mengatasi infeksi jamur yang menyerang organ dalam tubuh (sistemik), seperti blastomikosis, coccidioidomycosis, atau histoplasmosis. Obat ini juga kerap digunakan pada penderita infeksi jamur kulit yang tidak sembuh dengan ketoconazole obat oles atau griseofulvin. Lusanoc mengandung 200 mg ketoconazole. Obat antijamur jenis azole ini bekerja dengan cara menghentikan produksi ergosterol yang merupakan senyawa pembentuk dinding sel jamur. Efeknya, pertumbuhan dan perkembangan jamur akan terganggu sehingga infeksi pun mereda.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 95, NULL, NULL, NULL, '24-LUTA-0096'),
	(843, 'MYCOZOL CREAM 10 GR', '566', '32000', b'0', 0, '566.jpg', 'MYCOZOL 2% CREAM 10 G adalah sediaan topikal antijamur golongan imidazol yang efektif digunakan untuk mengatasi infeksi jamur pada kulit. Produk ini mengandung Miconazole Nitrate 2%, yang bekerja dengan menghambat biosintesis ergosterol pada jamur, komponen penting pada membran sel jamur, sehingga mengganggu integritas membran dan menyebabkan nekrosis sel jamur. Krim ini secara umum diindikasikan untuk pengobatan berbagai kondisi infeksi kulit yang disebabkan oleh fungi seperti Trichophyton, Epidermophyton, Microsporum, Candida, dan Malessezia furfur. Contoh infeksi yang dapat ditangani meliputi tinea pedis (kutu air), tinea cruris (gatal pada selangkangan), tinea corporis (kurap), dan kandidiasis kulit.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 14, NULL, NULL, NULL, '26-MYCR10-0097'),
	(844, 'METCOVAZIN CREAM 10GR', '525', '41000', b'0', 0, '525.jpg', 'Metcovazin Salep Green merupakan salep kulit yang mengandung bahan aktif Chitosan + Zinc oxide. Salep ini digunakan untuk menjaga kelembaban dan membantu penyembuhan luka di kulit', 33, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '33-MECR10-0098'),
	(845, 'BUFACOMB CREAM 5 GR', '106', '39000', b'0', 0, '106.jpg', 'Bufacomb adalah obat oles untuk mengatasi peradangan atau luka di bibir, gusi, dan bagian dalam mulut. Obat berbentuk krim ini dapat mengurangi keluhan perih dan bengkak pada sariawan yang timbul karena tergigit, tergesek kawat gigi, atau tersodok sikat gigi.Dalam 1 gr krim Bufacomb terkandung 1 mg triamcinolone acetonide. Bahan aktif ini bekerja dengan cara mengurangi produksi zat penyebab radang ketika bibir, gusi, atau bagian dalam mulut terluka. Dengan begitu, keluhan nyeri, kemerahan, dan bengkak di lokasi tersebut bisa mereda.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 13, NULL, NULL, NULL, '24-BUCR5G-0099'),
	(846, 'FUSON CREAM 5GR', '339', '81500', b'0', 0, '339.jpg', 'FUSON CREAM adalah obat antibiotik topikal yang digunakan untuk mengobati infeksi kulit primer dan sekunder yang disebabkan oleh bakteri. Informasi Umum Terkait Kandungan*: *Informasi ini bersifat edukatif dan tidak dimaksudkan sebagai klaim manfaat langsung dari produk. Obat ini mengandung Asam Fusidat (Fusidic Acid), suatu antibiotik yang bekerja dengan cara menghambat sintesis protein pada bakteri. Dengan mengganggu proses ini, Asam Fusidat menghentikan pertumbuhan dan perkembangbiakan bakteri yang sensitif terhadapnya, terutama bakteri Gram-positif seperti Staphylococcus aureus.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-FUCR5G-0100'),
	(847, 'FLAMAR EMULGEL 20 GR', '312', '25500', b'0', 0, 'default_image.png', 'FLAMAR GEL merupakan sediaan emulgel yang mengandung Natrium diklofenak. Natrium Diklofenak Gel adalah obat luar golongan antiinflamasi nonsteroid (OAINS) yang digunakan untuk meredakan nyeri dan peradangan pada otot, sendi, atau akibat cedera ringan seperti keseleo, terkilir, atau nyeri punggung.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 6, NULL, NULL, NULL, '26-FLEM20-0101'),
	(848, 'DAKTARIN CREAM 10GR', '213', '51000', b'0', 0, '213.jpg', 'DAKTARIN CREAM merupakan sediaan topikal atau obat oles kulit yang mengandung zat aktif Miconazole Nitrate. Krim ini digunakan untuk mengobati infeksi kulit yang disebabkan oleh dermatofit atau ragi, dan jamur lainnya. Miconazole bekerja dengan menghancurkan bakteri dan jamur penyebab infeksi. Dengan demikian, maka obat ini digunakan untuk mengatasi penyakit infeksi kulit yang diakibatkan oleh berbagai jenis jamur serta infeksi yang disebabkan karena bakteri gram positif.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '26-DACR10-0129'),
	(849, 'GASTRINAL SUSP 120ML', '343', '34500', b'0', 0, '343.jpg', 'GASTRINAL HD SUSPENSI merupakan obat dengan kandungan Hydrotalcite, Magnesium hydroxide, dan Simethicone. Obat ini digunakan untuk meringankan gejala-gejala yang berhubungan dengan kelebihan asam lambung, gastritis, tukak lambung, tukak usus 12 jari.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 54, NULL, NULL, NULL, '27-GASU12-0103'),
	(850, 'MUCIFAT SUSPENSI 100ML', '553', '65499.99', b'0', 0, '553.jpg', 'Mucifat Suspensi 100 Ml bermanfaat untuk mengatasi tukak lambung, ulkus duodenum, atau gastritis kronis. Mucifat Suspensi 100 Ml bekerja dengan cara menempel di bagian lambung atau usus yang luka dan melindunginya dari asam lambung, enzim pencernaan, dan garam empedu, sehingga membantu penyembuhan ulkus.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 229, NULL, NULL, NULL, '24-MUSU10-0104'),
	(851, 'PERIFLUX SUSP 60ML', '658', '51000', b'0', 0, 'default_image.png', 'Periflux adalah obat dengan kandungan Domperidone yang diindikasikan untuk pasien yang mengalami mual dan muntah. Periflux merupakan obat golongan antiemetik atau anti mual yang bekerja dengan cara menekan rasa mual dan muntah di sistem saraf pusat dengan menghambat reseptor dopamin perifer.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 44, NULL, NULL, NULL, '24-PESU60-0105'),
	(852, 'VOMETA DROPS 10 ML', '978', '79500', b'0', 0, '978.jpg', 'Vometa 5 Mg Drops 10 Ml bermanfaat untuk meredakan mual dan muntah, serta mengatasi gangguan saluran cerna, seperti gastroparesis.Vometa 5 Mg Drops 10 Ml bekerja dengan mempercepat gerakan saluran pencernaan, sehingga makanan di dalam lambung lebih cepat menuju usus. Dengan begitu, rasa mual dapat berkurang.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-VODR10-0106'),
	(853, 'LACOLDIN SYR 60ML', '440', '36000', b'0', 0, '440.jpg', 'Lacoldin Sirup digunakan untuk membantu meredakan gejala flu, seperti demam, pilek, sakit kepala, hidung tersumbat, dan bersin-bersin yang disertai batuk', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 34, NULL, NULL, NULL, '26-LASY60-0107'),
	(854, 'LAPISIV SYR 100ML', '449', '38000', b'0', 0, '449.jpg', 'Lapisiv Sirup adalah obat yang mengandung Diphenhydramine HCl, Dextromethorphan HBr, Phenylpropanolamine HCl, Ammon Cl, Glyceryl guaiacolate, Na citrate, Menthol yang digunakan untuk meredakan batuk dan pilek yang disertai dengan alergi', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 47, NULL, NULL, NULL, '26-LASY10-0108'),
	(855, 'ANDONEX SYR 100ML', '32', '31000', b'0', 0, '32.jpg', 'Andonex adalah obat yang digunakan untuk mengobati batuk berdahak kental, batuk alergi, atau batuk karena rangsangan pada selaput pernapasan. Andonex mengandung Glyceryl Guaiacolat yang berfungsi untuk membantu mengeluarkan dahak, Diphenhydramine HCl berfungsi sebagai antialergi, Dextromethorphan HBr berfungsi sebagai penekan batuk, Phenylephrine berfungsi untuk melegakan hidung tersumbat, dan ipecac tinct yang berfungsi untuk membantu mengencerkan dahak.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 35, NULL, NULL, NULL, '26-ANSY10-0109'),
	(856, 'SOLVINEX SYR 100ML', '834', '22000', b'0', 0, '834.jpg', 'Solvinex adalah obat untuk membantu mengencerkan dahak di saluran pernapasan sehingga lebih mudah dikeluarkan. Obat ini biasanya digunakan untuk meredakan batuk berdahak akibat bronkitis atau infeksi saluran napas lainnya.Solvinex mengandung bromhexine hydrochloride, yaitu zat aktif yang memecah serat pada dahak. Hal ini membuat lendir kental menjadi lebih cair dan mudah dikeluarkan saat batuk. Obat ini bisa digunakan oleh dewasa maupun anak-anak jika ada produksi dahak berlebihan akibat infeksi atau peradangan saluran napas.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 9, NULL, NULL, NULL, '26-SOSY10-0110'),
	(857, 'MUCOS SYR', '556', '22500', b'0', 0, '556.jpg', 'Mucos Sirup bermanfaat untuk mengatasi batuk berdahak dan gangguan pernapasan lain akibat produksi dahak yang berlebihan, seperti pada penyakit bronkiektasis.Mucos Sirup membantu mengencerkan dahak agar lebih mudah dikeluarkan dari tenggorokan saat batuk. Dengan begitu, saluran pernapasan lebih terbuka dan terasa lega.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 5, NULL, NULL, NULL, '24-MUSY-0111'),
	(858, 'DOSIVEC SYR 60 ML', '248', '57000', b'0', 0, '248.jpg', 'Dosivec adalah obat untuk meredakan batuk berdahak. Obat dengan kandungan erdosteine ini digunakan untuk bantu mengatasi keluhan pada kondisi bronkitis kronis atau bronkitis akut. Kandungan erdosteine yang ada di dalam Dosivec bekerja untuk mengencerkan dahak yang ada di saluran pernapasan. Dengan demikian, dahak menjadi lebih mudah untuk dikeluarkan ketika batuk.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 12, NULL, NULL, NULL, '24-DOSY60-0112'),
	(859, 'LASAL EXP SYR 100 ML', '451', '67999.99', b'0', 0, '451.jpg', 'Lasal Ekspektoran Sirup 100 Ml bermanfaat untuk melegakan pernapasan dan membantu mengeluarkan dahak pada kondisi asma atau batuk karena asma.Kandungan salbutamol dalam obat ini membantu melemaskan otot-otot di sekitar saluran pernapasan yang menyempit. Sedangkan, kandungan guaifenesin bekerja dengan cara mengencerkan dahak.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 27, NULL, NULL, NULL, '24-LAEXSY-0113'),
	(860, 'TEMPRA DROP 15 ML', '889', '56500', b'0', 0, '889.jpg', 'Tempra Drop Rasa Anggur bermanfaat untuk menurunkan demam, termasuk demam akibat imunisasi, serta rasa nyeri, seperti pada sakit kepala atau sakit gigi. Tempra Drop Rasa Anggur mengandung paracetamol. Obat ini bekerja pada otak untuk menurunkan suhu tubuh dan meningkatkan toleransi terhadap nyeri. Pada umumnya, Tempra ditujukan untuk anak-anak. Meski begitu, orang dewasa juga dapat mengonsumsinya bila bentuk sediaan lain tidak memungkinkan.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 6, NULL, NULL, NULL, '27-TEDR15-0114'),
	(861, 'TEMPRA SYR 60 ML', '890', '52500', b'0', 0, '890.jpg', 'Tempra Syrup 60 Ml bermanfaat untuk menurunkan demam dan meredakan nyeri, seperti sakit kepala dan sakit gigi.Tempra Syrup 60 Ml bekerja dengan cara mengurangi produksi zat penyebab peradangan, yaitu prostaglandin. Penurunan kadar prostaglandin di dalam tubuh akan membuat tanda peradangan seperti demam dan nyeri berkurang.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 9, NULL, NULL, NULL, '27-TESY60-0115'),
	(862, 'RHELAFEN FORTE SUSP 60ML', '739', '41500', b'0', 0, '739.jpg', 'Rhelafen Forte Sirup bermanfaat meredakan demam, dan mengurangi rasa nyeri akibat sakit gigi, sakit kepala, nyeri otot, nyeri pasca operasi, nyeri akibat cabut gigi, dan nyeri penyakit rematik.Rhelafen Forte Sirup mengandung ibuprofen. Ibuprofen bekerja dengan cara menghambat pembentukan prostaglandin, yaitu zat kimia yang memicu timbulnya tanda dan gejala radang, termasuk nyeri, bengkak, atau demam.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '26-RHFOSU-0116'),
	(863, 'RHELAFEN SUSP 60ML', '740', '31000', b'0', 0, '740.jpg', 'Rhelafen Suspensi 60 Ml bermanfaat untuk meredakan nyeri haid, sakit gigi, nyeri sendi, atau sakit kepala. Obat ini juga bisa digunakan untuk menurunkan demam.Rhelafen Suspensi 60 Ml mengandung ibuprofen yang bekerja dengan cara menghambat produksi prostaglandin, yaitu zat kimia di dalam tubuh yang menyebabkan munculnya gejala peradangan, termasuk nyeri dan bengkak, saat tubuh mengalami luka atau cedera.', 26, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '26-RHSU60-0117'),
	(864, 'PYRIDOL SYR 60ML', '722', '40000', b'0', 0, '722.jpg', 'Pyridol 120 mg Sirup bermanfaat untuk menurunkan demam dan meredakan nyeri, seperti sakit kepala dan sakit gigi.Pyridol 120 mg Sirup bekerja dengan cara mengurangi produksi zat penyebab peradangan, yaitu prostaglandin. Penurunan kadar prostaglandin di dalam tubuh akan membuat tanda peradangan seperti demam dan nyeri berkurang.', 27, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '27-PYSY60-0118'),
	(865, 'NORAGES SYR 60 ML', '608', '44000', b'0', 0, '608.jpg', 'NORAGES SIRUP merupakan obat yang di gunakan untuk meredakan sakit derajat sedang hingga berat, seperti sakit gigi, sakit kepala, nyeri haid, sakit punggung, nyeri kolik, pasca operasi, dan lain-lain. Norages mengandung Metamizole, yang bekerja dengan cara menghalangi sintesis pirogen endogen sehingga metamizole memiliki efek analgetik dan juga antiperadangan.', 24, '2026-01-14 23:01:12', '2026-01-19 22:01:52', 150, NULL, NULL, NULL, '24-NOSY60-0119'),
	(866, 'CENDO XITROL SALEP MATA 3,5GR', '169', '49000', b'0', 0, '169.jpg', 'CENDO XITROL SALEP MATA 3.5 G adalah salep mata steril yang mengandung kombinasi antibiotik (Neomycin dan Polymyxin B) dan kortikosteroid (Dexamethasone). Informasi Umum Terkait Kandungan: Neomycin dan Polymyxin bekerja sinergis sebagai agen antibakteri spektrum luas untuk membasmi bakteri. Sementara Dexamethasone berfungsi sebagai anti-inflamasi kuat untuk menekan peradangan dan gejala alergi. Kombinasi ini efektif untuk mengobati peradangan pada mata yang disebabkan oleh infeksi bakteri.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-CEXISA-0120'),
	(867, 'CENDO TOBROSON MINIDOSE', '166', '40000', b'0', 0, '166.jpg', 'CENDO TOBROSON MINIDOSE adalah obat tetes mata yang mengandung tobramycin sebagai antibiotik aminoglikosida yang di gunakan untuk mengobati infeksi akibat bakteri. Dalam mengobati infeksi tobramycin bekerja dengan cara membunuh bakteri dan menekan pertumbuhannya agar tidak muncul kembali. Cendo tobroson juga mengandung dexamethasone yang bekerja dengan menghambat respon inflamasi sehingga dapat membantu dalam meredakan peradangan pada mata.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-CETOMI-0121'),
	(868, 'CENDO PANTOCAIN 0.5% 5ML', '156', '17000', b'0', 0, '156.jpg', 'CENDO PANTOCAIN 0.5% 5ML merupakan obat dengan kandungan zak aktif Tetracaine / Tetrakain 0.5%. dalam bentuk Tetes Mata yang mempunyai efek kerja sebagai Anestesi lokal pada mata', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-CEPA05-0122'),
	(869, 'CENDO PANTOCAIN 2% 5ML', '158', '18500', b'0', 0, '158.jpg', 'CENDO PANTOCAIN 2% 5ML merupakan obat dengan kandungan zak aktif Tetracaine / Tetrakain 2%. dalam bentuk Tetes Mata yang mempunyai efek kerja sebagai Anestesi lokal pada mata', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-CEPA25-0123'),
	(870, 'FINPRO TAB 5MG', '302', '21999.99', b'0', 0, '302.jpg', 'obat yang digunakan untuk mengatasi pembesaran prostat jinak atau benign prostatic hyperplasia. Obat berbahan aktif finasteride ini juga bermanfaat untuk menangani kebotakan pada pria akibat kelebihan hormon androgen.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 51, NULL, NULL, NULL, '24-FITA5M-0124'),
	(871, 'ARINIA 5MG TAB', '43', '20500', b'0', 0, '43.jpg', 'Arinia adalah obat produksi Meprofarm yang mengandung Aripiprazole sebagai zat aktifnya. Arinia digunakan untuk membantu mengatasi penyakit bipolar dan skizofrenia.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 10, NULL, NULL, NULL, '24-AR5MTA-0125'),
	(872, 'PIBAKSIN OINT 10 GR', '661', '63000', b'0', 0, '661.jpg', 'PIBAKSIN 2% SALEP mengandung mupirocin yang di gunakan untuk mengatasi kulit impetigo atau infeksi kulit lainnya yang di sebabkan oleh bakteri taphylococcus.Mupirocin merupakan salah satu antibiotik golongan karbapenem, yang memiliki sifat bakteriostatik dan bekerja dengan menghambat sintesis protein dari bakteri dengan mengikat asam transfer ribonucleid acid (RNA) synthetase.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 19, NULL, NULL, NULL, '24-PIOI10-0126'),
	(873, 'MYCORINE POWDER 25GR', '565', '61500', b'0', 0, '565.jpg', 'Mycorine Powder 25 gr adalah obat yang digunakan untuk mengobati penyakit kulit akibat infeksi jamur, mycorine mengandung miconazole mengikat fosfolipid dalam membran sel dan menghambat biosintesis ergosterol dan sterol lain yang diperlukan untuk produksi membran sel. Hal ini menyebabkan kematian sel melalui hilangnya unsur intraseluler.', 26, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 11, NULL, NULL, NULL, '26-MYPO25-0127'),
	(874, 'BETADINE SALEP 5 GR', '75', '17500', b'0', 0, '75.jpg', 'Betadine 10 % Salep 5 g adalah obat luar dalam bentuk salep antiseptik yang mengandung bahan aktif Povidone-Iodine. Produk ini berfungsi untuk membantu mencegah infeksi pada luka. Mekanisme kerjanya adalah dengan melepaskan yodium (iodine) secara perlahan, yang merupakan zat antimikroba dengan spektrum luas. Produk ini hanya untuk penggunaan luar tubuh.', 33, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '33-BESA5G-0128'),
	(875, 'DAKTARIN CREAM 10GR', '26-DACR10-0129', '51000', b'0', 0, 'default_image.png', 'DAKTARIN CREAM merupakan sediaan topikal atau obat oles kulit yang mengandung zat aktif Miconazole Nitrate. Krim ini digunakan untuk mengobati infeksi kulit yang disebabkan oleh dermatofit atau ragi, dan jamur lainnya. Miconazole bekerja dengan menghancurkan bakteri dan jamur penyebab infeksi. Dengan demikian, maka obat ini digunakan untuk mengatasi penyakit infeksi kulit yang diakibatkan oleh berbagai jenis jamur serta infeksi yang disebabkan karena bakteri gram positif.', 26, '2026-01-14 23:01:13', NULL, NULL, NULL, NULL, NULL, NULL),
	(876, 'EXELCARE HYDROGEL SILVER PLUS AG', '278', '129500', b'0', 0, '278.jpg', 'Exelcare Hydrogel Silver Plus Alginate 30 g merupakan produk kesehatan dalam bentuk gel kombinasi dari hydrogel sebagai suport autolisis pada jaringan nekrotik, ditambah kombinasi silver serta alginate yang dapat digunakan pada luka-luka infeksi.', 33, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '33-EXHYSI-0130'),
	(877, 'INODERM CREAM 10GR', '400', '21500', b'0', 0, '400.jpg', 'Inoderm Krim merupakan obat dengan kandungan zat aktif Fluocinolone Acetonide 0,25% dalam bentuk krim yang mempunyai efek kerja sebagai obat untuk meredakan manifestasi peradangan dan pruritus dari dermatosis yang responsif terhadap kortikosteroid.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 3, NULL, NULL, NULL, '24-INCR10-0131'),
	(878, 'DIAVERSA TAB 2 MG', '234', '3500', b'0', 0, '234.jpg', 'DIAVERSA TABLET merupakan obat anti diabetes mengandung Glimepiride yang termasuk ke dalam golongan sulfonilurea. Diaversa digunakan sebagai obat anti diabetes mellitus tipe 2 atau Non-Insulin-Dependent (type II) Diabetes Melitus (NIDDM) dimana kadar glukosa darah tidak dapat hanya dikontrol dengan diet dan olahraga saja.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 148, NULL, NULL, NULL, '24-DITA2M-0132'),
	(879, 'ALDISA SR CAPSULE', '1378', '8500', b'0', 0, '1378.jpg', 'ALDISA SR 10 KAPSUL mengandung Loratadine dan Pseudoephedrine sulfate. Obat ini digunakan untuk mengatasi gejela rhinitis alergi dan flu seperti hidung tersumbat, bersin atau pruritus. Loratadine merupakan long acting non sedatif histamin yang bertindak sebagai inverse agonist selektif histamin perifer H1 reseptor dan Pseudoephedrine (vasokronstriktor, bekerja pada reseptor alpha dan menghasilkan efek dekongestan dengan mengurangi mukosa sesak didaerah pernapasan bagian atas.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 111, NULL, NULL, NULL, '24-ALSRCA-0133'),
	(880, 'VILDI TAB 50MG', '969', '6999.99', b'0', 0, '969.jpg', 'Vildi adalah obat untuk menurunkan kadar gula darah pada penderita diabetes tipe 2, terutama yang kadar gulanya tidak bisa dikontrol dengan diet dan olahraga saja. Obat berbahan aktif vildagliptin ini dapat digunakan sebagai terapi tunggal atau dikombinasikan dengan obat antidiabetes lain, seperti metformin.Tiap tablet Vildi mengandung vildagliptin sebanyak 50 mg. Vildagliptin bekerja dengan cara meningkatkan respons pankreas untuk memproduksi insulin ketika kadar gula darah tinggi, misalnya setelah makan, sehingga kadar gula darah bisa lebih terkontrol.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 179, NULL, NULL, NULL, '24-VITA50-0134'),
	(881, 'TUDIAB TAB', '919', '2500', b'0', 0, '919.jpg', 'Tudiab merupakan obat dengan kandungan metformin. Metformin adalah obat antidiabetes generik yang digunakan untuk mengontrol dan menurunkan kadar gula darah pada penderita diabetes tipe 2. Metformin termasuk obat antidiabetes golongan Biguanide, bekerja dengan cara menghambat produksi glukosa (glukoneogenesis) di hati. Penghambatan tersebut mengakibatkan terjadinya penundaan absorbsi atau penyerapan glukosa di usus, sehingga menurunkan glukosa plasma baik basal maupun postprandial (setelah makan). Selain itu, Metformin juga bekerja dengan memperbaiki sensitivitas insulin dengan cara meningkatkan ambilan dan penggunaan glukosa di jaringan perifer. Dengan demikian, maka akan terjadi perbaikan toleransi glukosa pada pasien diabetes tipe 2. Obat ini dapat dikonsumsi secara tunggal, dikombinasikan dengan obat antidiabetes lain, atau diberikan bersama insulin.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 75, NULL, NULL, NULL, '24-TUTA-0135'),
	(882, 'DIAMICRON TAB MR 60MG', '233', '10500', b'0', 0, '233.jpg', 'Diamicron adalah obat diabetes berbahan aktif gliclazide. Diamicron bermanfaat untuk menstabilkan kadar gula darah pada penderita diabetes tipe 2. Penggunaan Diamicron secara rutin sesuai arahan dokter dapat menekan risiko terjadinya komplikasi diabetes, seperti penyakit jantung, stroke, atau gagal ginjal.Gliclazide pada Diamicron masuk dalam daftar obat antidiabetes golongan sulfonilurea. Gliclazide bekerja merangsang pankreas untuk memproduksi lebih banyak insulin sekaligus mengoptimalkan kerja hormon tersebut.', 33, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 64, NULL, NULL, NULL, '33-DITAMR-0136'),
	(883, 'LAPIGIM 2/500 TAB', '448', '9000', b'0', 0, '448.jpg', 'LAPIGIM KAPLET merupakan obat anti diabetes kombinasi yang terdiri dari Metformin (antidiabetes oral golongan biguanid) dan Glimepiride (antidiabetes oral golongan sulfonilurea). Obat ini digunakan untuk pengobatan diabetes mellitus tipe 2. Lapigim digunakan dengan diet dan olahraga, untuk mengobati DM Tipe 2 ketika penggunaan glimepiride atau metformin saja tidak menghasilkan kontrol glikemik yang adekuat. Obat ini juga digunakan sebagai pengganti terapi kombinasi glimepiride dan metformin.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 384, NULL, NULL, NULL, '24-LA25TA-0137'),
	(884, 'DIAVERSA TAB 4 MG', '235', '5499.88', b'0', 0, 'default_image.png', 'Diaversa adalah obat antidiabetik yang dikemas dalam bentuk sediaan tablet. Diaversa mengandung glimepiride yang digunakan untuk mengontrol kadar gula darah yang tinggi pada penderita diabetes tipe 2. Diaversa dapat dikombinasikan dengan obat diabetes lainnya. Dengan mengontrol gula darah tinggi dapat membantu mencegah kerusakan ginjal, kebutaan, masalah saraf, stroke dan masalah fungsi seksual. Kontrol yang tepat pada pasien diabetes juga dapat mengurangi risiko serangan jantung. Diaversa bekerja dengan menurunkan kadar gula darah dalam tubuh melalui pelepasan insulin alami tubuh.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 1048, NULL, NULL, NULL, '24-DITA4M-0138'),
	(885, 'XIGDUO XR 10/500 MG TAB', '1363', '29499.99', b'0', 0, '1363.jpg', 'Xingduo XR adalah obat yang mengandung dapagliflozin propanediol monohydrate dan metformin. Xingduo XR berfungsi untuk memberikan mengontrol kadar gula darah pada pasien yang memiliki respon buruk terhadap penggunaan metformin monoterapi. Obat ini digunakan untuk membantu mengontrol kadar gula darah pada pasien Diabetes Mellitus tipe 2 yang tidak teratasi dengan diet dan olahraga. Dapagliflozin bekerja dengan cara menghambat penyerapan kembali glukosa di tubuli distal ginjal dengan cara menghambat kinerja transporter glukosa SGLT-2, sedangkan Metformin bekerja dengan cara menambah sensitivitas terhadap insulin.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 28, NULL, NULL, NULL, '24-XIXR10-0139'),
	(886, 'EZERO 10/10 MG TAB', '1365', '30500', b'0', 0, '1365.jpg', 'EZERO 10/10MG TABLET digunakan untuk mengontrol kolesterol dan trigliserida sehingga dapat mengurangi risiko penyakit kardiovaskular (jantung dan pembuluh darah). Obat ini memiliki kandungan bahan aktif Rosuvastatin dan Ezetimibe. Rosuvastatin termasuk obat golongan inhibitor reductase HMG CoA atau statin yang bekerja dengan cara mengurangi pembentukan kolesterol oleh hati sehingga kadar kolesterol di dalam darah terkendali. Sedangkan Ezetimibe bekerja dengan menghambat penyerapan lemak di usus. Ezero dapat dikonsumsi sebelum atau sesudah makan.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 30, NULL, NULL, NULL, '24-EZ10MG-0140'),
	(887, 'SOLVINEX SOLUTION 30ML/1CC', '833', '2500', b'0', 0, '833.jpg', 'Solvinex adalah obat untuk membantu mengencerkan dahak di saluran pernapasan sehingga lebih mudah dikeluarkan. Obat ini biasanya digunakan untuk meredakan batuk berdahak akibat bronkitis atau infeksi saluran napas lainnya. Solvinex Larutan 30 ml, dengan kandungan 2 mg bromhexine dalam tiap 1 ml nyaSolvinex mengandung bromhexine hydrochloride, yaitu zat aktif yang memecah serat pada dahak. Hal ini membuat lendir kental menjadi lebih cair dan mudah dikeluarkan saat batuk. Obat ini bisa digunakan oleh dewasa maupun anak-anak jika ada produksi dahak berlebihan akibat infeksi atau peradangan saluran napas.', 33, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 172, NULL, NULL, NULL, '33-SOSO30-0141'),
	(888, 'MEPROVENT INHALASI', '522', '11499.99', b'0', 0, '522.jpg', 'Meprovent Cairan Inhalasi merupakan obat dengan kandungan zat aktif tiap 2.5 ml mengandung Ipratropium Br 0.5 mg, salbutamol 2.5 mg dalam bentuk cairan infeksi yang mempunyai efek kerja sebagai bronkospasme yang disebabkan oleh penyakit paru obstruktif & serangan asma akut pada pasien dengan & 1 terapi bronkodilator.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 43, NULL, NULL, NULL, '24-MEIN-0142'),
	(889, 'BUDESMA 0,5 NEBUL', '105', '26500', b'0', 0, '105.jpg', 'Budesma adalah obat untuk mencegah serangan asma. Obat dalam sediaan cair ini digunakan dengan nebulizer. Budesma hanya boleh digunakan di bawah pengawasan dokter.Budesma mengandung budesonide, yang bekerja dengan cara meredakan peradangan di saluran pernapasan. Dengan begitu, pernapasan menjadi lebih lega dan kambuhnya asma bisa dicegah. Obat ini digunakan dengan nebulizer, yang mengubah cairan obat menjadi uap untuk dihirup. Cara penggunaan Budesma akan membuat kandungan obat lebih mudah masuk ke jalur napas yang menyempit akibat peradangan, seperti asma atau PPOK.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 119, NULL, NULL, NULL, '24-BU05NE-0143'),
	(890, 'LASAL NEBUL 2,5 MG/2,5 ML', '452', '16500', b'0', 0, '452.jpg', 'LASAL NEBU adalah obat sediaan larutan inhalasi steril yang mengandung zat aktif Salbutamol Sulfate. Salbutamol termasuk dalam golongan bronkodilator kerja cepat (short-acting beta-2 adrenergic agonist). Obat ini bekerja secara spesifik dengan cara merelaksasi otot-otot polos di sekitar saluran pernapasan (bronkus), sehingga saluran napas yang menyempit menjadi lebih lebar (bronkodilatasi). Efek ini membuat udara dapat mengalir lebih lancar ke dalam paru-paru, sehingga napas menjadi lega. Lasal Nebu digunakan dengan alat nebulizer untuk mengatasi sesak napas atau mengi secara cepat.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 211, NULL, NULL, NULL, '24-LANE25-0144'),
	(891, 'DEMACOLIN TABLET STRIP', '216', '1500', b'0', 0, '216.jpg', 'Demacolin bermanfaat untuk mengobati gejala flu atau batuk pilek, seperti demam, sakit kepala, hidung tersumbat, hidung meler, dan bersin-bersin. Demacolin tersedia dalam bentuk tablet dan sirup.Demacolin mengandung paracetamol, pseudoephedrine, dan chlorpheniramine maleate (chlorpheniramine). Kombinasi bahan-bahan ini tidak dapat melawan penyebab infeksi, tetapi dapat meredakan gejala flu yang bisa mengganggu aktivitas penderita.', 33, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 520, NULL, NULL, NULL, '33-DETAST-0145'),
	(892, 'LAPISIV-T TAB', '450', '3500', b'0', 0, '450.jpg', 'LAPISIV-T TABLET merupakan obat yang digunakan untuk mengatasi gejala pilek seperti bersin-bersin yang disertai batuk karena alergi', 26, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 1407, NULL, NULL, NULL, '26-LATA-0146'),
	(893, 'LACOLDIN TAB', '441', '3500', b'0', 0, '441.jpg', 'Lacoldin Tablet digunakan untuk membantu meredakan gejala flu, seperti demam, pilek, sakit kepala, hidung tersumbat, dan bersin-bersin yang disertai batuk.', 26, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 230, NULL, NULL, NULL, '26-LATA-0147'),
	(894, 'GLYCERYL GUAIACOLATE TAB', '26-GLGUTA-0148', '1000', b'0', 0, 'default_image.png', 'GUAIFENESIN/ GLYCERYL GUAIACOLATE TABLET merupakan obat jenis ekspektoran yang dapat meredakan batuk dan melancarkan pengeluaran dahak di saluran napas. Obat ini bekerja dengan cara meningkatkan volume dahak dan membuatnya lebih encer sehingga lebih mudah dikeluarkan dari saluran pernapasan melalui jalur nafas dengan proses batuk.', 26, '2026-01-14 23:01:13', NULL, NULL, NULL, NULL, NULL, NULL),
	(895, 'PARATUSIN TAB', '649', '2500', b'0', 0, '649.jpg', 'Paratusin adalah obat yang bermanfaat untuk meredakan gejala flu seperti batuk, pilek, demam, sakit kepala, nyeri otot, atau bronkitis. Obat ini tersedia dalam dua sediaan, yaitu tablet dan sirup.', 26, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 168, NULL, NULL, NULL, '26-PATA-0149'),
	(896, 'PARATUSIN SYR 60 ML', '648', '47000', b'0', 0, '648.jpg', 'Paratusin adalah obat yang bermanfaat untuk meredakan gejala flu seperti batuk, pilek, demam, sakit kepala, nyeri otot, atau bronkitis. Obat ini tersedia dalam dua sediaan, yaitu tablet dan sirup.', 26, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '26-PASY60-0150'),
	(897, 'PROHISTIN TAB 10 MG', '696', '6499.99', b'0', 0, '696.jpg', 'Prohistin adalah obat untuk meredakan gejala alergi pada pasien rhinitis alergi, eksim, biduran, konjungtivitis alergi, atau alergi makanan. Obat yang mengandung loratadine ini hanya boleh dikonsumsi berdasarkan resep dari dokter. Prohistin mengandung loratadine, yang bekerja dengan cara memblokir histamin, yaitu senyawa pemicu munculnya reaksi alergi di dalam tubuh. Dengan begitu, gejala alergi yang ditandai dengan kulit gatal, bersin, hidung meler, mata berair, hidung atau tenggorokan gatal, bisa teratasi.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 311, NULL, NULL, NULL, '24-PRTA10-0151'),
	(898, 'TIRIZ TABLET', '903', '7500', b'0', 0, '903.jpg', 'Tiriz adalah obat yang bermanfaat untuk meredakan gejala alergi, seperti bersin-bersin, mata gatal dan berair, pilek, hidung tersumbat atau meler, atau gatal-gatal dan biduran. Obat ini tersedia dalam bentuk kaplet dan obat tetes oral (drops).Kandungan cetirizine dalam Tiriz merupakan obat golongan antihistamin. Obat ini bekerja dengan cara menghambat produksi histamin ketika tubuh terpapar pemicu alergi. Histamin adalah senyawa yang memicu timbulnya gejala alergi. Dengan dihambatnya histamin, keluhan alergi yang muncul akan mereda.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 652, NULL, NULL, NULL, '24-TITA-0152'),
	(899, 'PRONICY FILCO TAB 4MG', '703', '1000', b'0', 0, '703.jpg', 'PRONICY adalah obat antihistamin yang tidak hanya digunakan untuk meredakan gejala alergi, tetapi juga dapat berfungsi sebagai penambah nafsu makan.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 656, NULL, NULL, NULL, '24-PRFITA-0153'),
	(900, 'PROCELES TAB', '690', '4000', b'0', 0, '690.jpg', 'Proceles adalah obat yang digunakan untuk meredakan reaksi alergi sedang hingga berat, meliputi ruam gatal pada kulit, mata berair, hidung meler, dan bersin-bersin. Obat ini hanya boleh digunakan sesuai dengan anjuran dokter.Proceles mengandung betametason dan dexchlorpheniramine maleate. Perpaduan kedua bahan tersebut bekerja dengan menghambat senyawa yang diproduksi tubuh saat mengalami peradangan, seperti histamin dan prostaglandin.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 215, NULL, NULL, NULL, '24-PRTA-0154'),
	(901, 'PROCELES SYR 60ML', '689', '48000', b'0', 0, '689.jpg', '"Proceles adalah obat yang digunakan untuk meredakan reaksi alergi sedang hingga berat, meliputi ruam gatal pada kulit, mata berair, hidung meler, dan bersin-bersin. Obat ini hanya boleh digunakan sesuai dengan anjuran dokter.Proceles mengandung betametason dan dexchlorpheniramine maleate. Perpaduan kedua bahan tersebut bekerja dengan menghambat senyawa yang diproduksi tubuh saat mengalami peradangan, seperti histamin dan prostaglandin."', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 68, NULL, NULL, NULL, '24-PRSY60-0155'),
	(902, 'OTEDE TAB', '637', '2000', b'0', 0, '637.jpg', 'OTEDE adalah obat antihistamin yang mengandung zat aktif Diphenhydramine 25 mg. Obat ini berfungsi untuk meredakan gejala-gejala yang berkaitan dengan reaksi alergi, seperti hidung tersumbat, bersin, gatal-gatal, dan ruam kulit. Mekanisme kerjanya adalah dengan memblokir reseptor histamin H1 di dalam tubuh, sehingga mencegah histamin menghasilkan respons alergi. Efek ini juga yang menyebabkan rasa kantuk. Oleh karena itu, Sedares harus digunakan dengan hati-hati. Karena efek sedatifnya, obat ini juga dapat digunakan untuk meredakan gejala mabuk perjalanan dan membantu menenangkan sistem saraf, sehingga dapat membantu tidur.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 127, NULL, NULL, NULL, '24-OTTA-0156'),
	(903, 'HEPTASAN TAB 4 MG', '370', '1500', b'0', 0, '370.jpg', 'HEPTASAN 4 MG adalah obat yang digunakan untuk mengobati berbagai jenis alergi. Heptasan mengandung Cyproheptadine Obat ini termasuk golongan antihistamin generasi pertama yang bermanfaat juga sebagai antikolinergik, antiserotonergic, dan sifat anestesi lokal. Cyproheptadine bekerja dengan cara menghambat efek dari histamin sehingga berbagai reaksi alergi itu dapat dikurangi.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 126, NULL, NULL, NULL, '24-HETA4M-0157'),
	(904, 'XANTIA LICAPS', '989', '10500', b'0', 0, '989.jpg', 'Xantia adalah suplemen untuk membantu menjaga kesehatan kulit dan mata, serta mendukung daya tahan tubuh. Xantia tersedia dalam bentuk kapsul dan dapat dibeli tanpa resep dokter. Meski demikian, penggunaannya tetap disarankan untuk dikonsultasikan terlebih dahulu dengan dokter.', 27, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 29, NULL, NULL, NULL, '27-XALI-0158'),
	(905, 'ROSAGEN FORCE SACHET', '751', '40500', b'0', 0, '751.jpg', 'Rosagen Force merupakan suplemen nutrisi yang diformulasikan khusus untuk mendukung kesehatan sendi, tulang rawan, dan jaringan ikat, serta mengurangi gejala nyeri sendi, kaku, dan peradangan terutama pada penderita osteoartritis atau individu dengan keluhan sendi karena aktivitas fisik atau usia lanjut', 25, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 15, NULL, NULL, NULL, '25-ROFOSA-0159'),
	(906, 'NEURAXON TAB 5000 MG', '594', '5000', b'0', 0, '594.jpg', 'Neuraxon-5000 adalah suplemen kombinasi vitamin B1, B6, dan B12 yang digunakan untuk mengatasi gangguan pada saraf. Informasi Umum Terkait Kandungan: Vitamin B1 (Tiamin) bekerja sebagai koenzim pada proses metabolisme karbohidrat. Vitamin B6 (Piridoksin) berperan dalam metabolisme protein dan asam amino. Vitamin B12 (Sianokobalamin) penting untuk pembentukan sel darah merah dan menjaga fungsi sistem saraf. Kombinasi ketiganya mendukung perbaikan dan pemeliharaan fungsi saraf.', 25, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 10, NULL, NULL, NULL, '25-NETA50-0160'),
	(907, 'LABUMIN 500 MG CAP', '439', '11000', b'0', 0, '439.jpg', 'Labumin merupakan suplemen makanan yang memiliki kandungan ekstrak ikan gabus. Manfaat dari ekstrak ikan gabus yaitu Meningkatkan daya tahan tubuh, Membantu penyembuhan luka operasi lebih cepat, Meningkatkan kadar albumin dan hemoglobin (Hb) dan Nutrisi tambahan.', 25, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 77, NULL, NULL, NULL, '25-LA50MG-0161'),
	(908, 'TRACETATE TAB', '913', '37000', b'0', 0, '913.jpg', 'TRACETATE 160 MG merupakan obat yang di gunakan untuk mengobat kanker payudara atau rahim, Tracetate mengandung Megestrol tergolong sebagai kelas obat kanker yanng di sebut terapi hormon kanker. Hormon yang mirip dengan hormon wanita alami yang di sebut progesteron. Megestrol juga dapat digunakan untuk meningkatkan nafsu makan dan untuk mencegah atau membalikkan penurunan berat badan yang signifikan.', 24, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 30, NULL, NULL, NULL, '24-TRTA-0162'),
	(909, 'PROXIDAN LICAPS', '712', '6000', b'0', 0, '712.jpg', 'Proxidan 400 10 Tablet bermanfaat untuk mencegah dan mengatasi kekurangan vitamin E.Proxidan 400 10 Tablet merupakan suplemen makanan yang mengandung D-alpha-tocopherol 400 IU. D-alpha-tocopherol 400 IU merupakan sintetik vitamin E yang bermanfaat sebagai antioksidan. D-alpha-tocopherol 400 IU juga dapat digunakan untuk menutrisi kulit, mengatasi defisiensi vitamin E, serta terapi suportif pada kardiovaskular. Proxidan diproduksi oleh Meprofarm dalam bentuk sediaan licaps. Licaps merupakan hasil dari teknologi inovatif yang salah satunya digunakan untuk cairan yang terbuat dari gelatin.', 25, '2026-01-14 23:01:13', '2026-01-19 22:01:52', 77, NULL, NULL, NULL, '25-PRLI-0163'),
	(910, 'KETOS CAP', '1406', '11000', b'0', 0, 'default_image.png', 'Ketos Kaplet merupakan obat dengan kandungan zak aktif Tiap mengandung Alpha-keto-isoleucin Calcium 67 mg, Alpha-keto-leucine Calcium 101 mg, Alpha-keto-phenylalanine Calcium 68 mg, Alpha-keto-valine Calcium 86 mg, Alpha-hydroxy Methionine Calcium 59 mg, Lysine Acetate 105 mg, Threonine 53 mg, Tryptophane 23 mg, Histidine 38 mg, Tyrosine 30 mg dalam bentuk Kaplet yang mempunyai efek kerja sebagai insufisiensi ginjal kronik pada retensi yang terkompensasi atau dekompensasi.', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 445, NULL, NULL, NULL, '24-KECA-0164'),
	(911, 'IMUDATOR TAB', '386', '13000', b'0', 0, 'default_image.png', 'mudator adalah suplemen vitamin dan mineral yang dapat menambah imunitas tubuh. Suplemen ini tersedia dalam bentuk kaplet dan sirup.Imudator mengandung beragam kandungan mulai dari Echinacea purpurea radix extract hingga Phyllantus niruri extract yang mampu merangsang sistem kekebalan. Dengan begitu, tubuh dapat melawan serangan penyakit secara lebih optimal. Selain itu, Imudator bermanfaat untuk mempercepat proses pemulihan dari luka.', 25, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 22, NULL, NULL, NULL, '25-IMTA-0165'),
	(912, 'FOLAPLUS KAPLET', '322', '2000', b'0', 0, 'default_image.png', 'Folaplus adalah suplemen untuk ibu hamil yang mengandung asam folat 400 mcg, vitamin B6 6 mg dan vitamin B12 25 mcg. Asam folat berfungsi untuk menambah produksi sel darah merah, vitamin B6 berfungsi untuk menekan mual pada ibu hamil, vitamin B12 berfungsi untuk menjaga kesehatan saraf, tubuh, dan juga membantu pembentukan DNA, serta sel-sel darah.', 25, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 175, NULL, NULL, NULL, '25-FOKA-0166'),
	(913, 'DTRIVIT 1000', '252', '4000', b'0', 0, 'default_image.png', 'Dtrivit adalah obat yang mengandung vitamin D3. Dtrivit digunakan untuk membantu memenuhi kebutuhan vitamin D pada pasien yang kekurangan vitamin D. Vitamin ini berfungsi untuk menjaga kesehatan tulang, mengatur kadar kalsium dan membantu menjaga daya tahan tubuh.Dtrivit tersedia dalam kandungan vitamin D3 400 IU dan 1000 IU.', 25, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 185, NULL, NULL, NULL, '25-DT10-0167'),
	(914, 'URINTER CAPS', '933', '9500', b'0', 0, 'default_image.png', 'Urinter adalah antibiotik yang digunakan secara spesifik untuk pengobatan infeksi pada saluran kemih (ISK). Informasi umum terkait kandungan: Obat ini mengandung Pipemidic Acid', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 27, NULL, NULL, NULL, '24-URCA-0168'),
	(915, 'UROTRACTIN CAPS', '934', '6000', b'0', 0, 'default_image.png', 'UROTRACTIN 400 MG Merupakan obat yang digunakan untuk mengobati infeksi saluran kemih baik akut maupun kronis. Urotractin mengandung asam pipemidat mekanisme kerja obat ini adalah dengan menghambat DNA girase pada proses sintesis DNA', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 60, NULL, NULL, NULL, '24-URCA-0169'),
	(916, 'LAPIBION TAB', '1407', '2500', b'0', 0, 'default_image.png', 'LAPIBION 10 TABLET digunakan dalam perawatan, kontrol, pencegahan, perbaikan penyakit, kondisi dan gejala berikut ini neuritis, neuroparalysis, lumbago, neuralgia, pareshthesia, asthenia, neuropathy, kelelahan.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 980, NULL, NULL, NULL, '34-LATA-0170'),
	(917, 'PSIDII CAPS 500 MG', '713', '8500', b'0', 0, 'default_image.png', 'PSIDII merupakan suplemen yang digunakan sebagai terapi penunjang dalam meningkatkan kadar trombosit atau sel darah merah pada penderita Demam Berdarah Dengue (DBD). PSIDII mengandung ekstrak daun jambu (Psidii folium extract) yang memiliki berbagai macam komponen senyawa tanin dan flavonoid atau quersetin yang dapat menghambat aktivitas enzim reverse transcriptase sehingga dapat menghambat pertumbuhan Virus dengue (VD). Selain itu, ekstrak daun jambu dapat meningkatkan jumlah megakariosit dalam sumsum tulang sehingga dapat meningkatkan jumlah trombosit dalam darah.', 35, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 38, NULL, NULL, NULL, '35-PSCA50-0171'),
	(918, 'NATABION TAB', '581', '3500', b'0', 0, 'default_image.png', 'Natabion digunakan sebagai suplemen vitamin dan mineral untuk ibu hamil dan menyusui. Natabion juga dapat digunakan oleh ibu hamil dan menyusui yang mengalami anemia (kekurangan zat besi). Setiap kapsul Natabion mengandung Fe fumarate 360 mg, asam folat 1,5 mg, vit amin B12 15 mcg, Ca karbonat 200 mg, vitamin C 75 mg, dan cholecalciferol 400 IU.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 111, NULL, NULL, NULL, '34-NATA-0172'),
	(919, 'BENOVIT C TAB', '69', '3000', b'0', 0, 'default_image.png', 'BENOVIT C TAB merupakan miltivitamin yang dapat membantu memenuhi kebutuhan vitamin pada kondisi peningkatan kebutuhan vitamin B kompleks dan vitamin C misalnya pada masa hamil, laktasi, pertumbuhan dan perkembangan, infeksi, ketegangan fisik dan mental.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 307, NULL, NULL, NULL, '34-BECTA-0173'),
	(920, 'GLISODIN CAP', '1327', '11500', b'0', 0, 'default_image.png', 'GLISODIN adalah antioksidan alami yang berasal dari ekstrak melon (Cucumis melo) yang dapat dikonsumsi oleh segala usia. GLISODIN mengandung SOD (Superoxide Dismutase) 250IU + Gliadin yang berfungsi sebagai penangkal utama radikal bebas. SOD (Superoxide Dismutase) adalah antioksidan yang sebenarnya diproduksi oleh tubuh (antioksidan endogen) sebagai perlindungan awal yang sangat kuat melindungi tubuh dari pengaruh buruk radikal bebas. SOD (Superoxide Dismutase) yang terdapat pada GliSODin dilengkapi dengan Gliadin yaitu protein unik yang melindungi SOD (Superoxide Dismutase) dari proses perusakan di saluran cerna sekaligus membantu mengoptimalkan penyerapannya.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 75, NULL, NULL, NULL, '34-GLCA-0174'),
	(921, 'ILIADIN DROP', '382', '104000', b'0', 0, 'default_image.png', 'Iliadin adalah obat untuk mengatasi keluhan hidung tersumbat yang bisa disebabkan oleh flu, batuk pilek, rhinitis alergi, atau sinusitis. Iliadin dijual bebas dalam sediaan tetes hidung dan semprot hidung. Iliadin mengandung bahan aktif oxymetazoline. Obat ini masuk dalam daftar obat dekongestan. Oxymetazoline dapat mengecilkan pembuluh darah yang membengkak di rongga hidung sehingga rongga hidung menjadi lebih lega. Dengan begitu, keluhan hidung tersumbat akan berkurang.', 33, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '33-ILDR-0175'),
	(922, 'VOSTEON TAB', '982', '7500', b'0', 0, 'default_image.png', 'Vosteon digunakan untuk meredakan sakit pada penderita osteoarthritis dan membantu meningkatkan pembentukan kolagen. Vosteon merupakan suplemen yang mengandung Glucosamine HCl, Chondroitin Sulphate, Ipriflavone dan Calcium Citrate. Vosteon digunakan untuk memelihara kesehatan tulang dan sendi.', 27, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 55, NULL, NULL, NULL, '27-VOTA-0176'),
	(923, 'COXAVIT TAB', '202', '8000', b'0', 0, 'default_image.png', 'COXAVIT adalah suplemen kesehatan yang diformulasikan dengan kombinasi multivitamin dan mineral. Produk ini dirancang untuk membantu memelihara kesehatan tubuh. Produk ini mengandung berbagai nutrisi yang bekerja sebagai antioksidan. Beta carotene, Lutein, dan Lycopene adalah karotenoid yang membantu melindungi sel-sel tubuh, termasuk mata dan kulit, dari kerusakan akibat radikal bebas. Vitamin C dan Vitamin E adalah antioksidan kuat yang bekerja sinergis untuk melindungi membran sel dan mendukung sistem imun. Zinc dan Selenium adalah mineral penting yang berperan dalam fungsi kekebalan tubuh dan sistem pertahanan antioksidan tubuh.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 54, NULL, NULL, NULL, '34-COTA-0177'),
	(924, 'PROIMBUS FC TAB', '697', '7500', b'0', 0, 'default_image.png', 'Proimbus mengandung ekstrak echinacea, ekstrak reishi mushroom dan kalsium pantotenate. Kandungan-kandungan yang terdapat pada Proimbus apabila dikombinasikan dapat membantu memperbaiki sistem imun tubuh menjadi lebih baik.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 172, NULL, NULL, NULL, '34-PRFCTA-0178'),
	(925, 'COTEN 100MG TAB', '199', '24500', b'0', 0, 'default_image.png', 'Coten merupakan suplemen yang digunakan untuk terapi suportif dalam memelihara kesehatan jantung agar terhindar dari penyakit jantung koroner, gagal jantung, dan penyakit pembuluh darah tepi serta memiliki efek antioksidan bagi tubuh.', 27, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 30, NULL, NULL, NULL, '27-CO10TA-0179'),
	(926, 'BONCERIN CAPS', '1368', '9500.01', b'0', 0, 'default_image.png', 'Boncerin memiliki kandungan Diacerein yang digunakan sebagai vitamin dan membantu mengurangi osteoarthritis (pengeroposan tulang yang menyebabkan nyeri pada sendi). Diacerein adalah turunan antrakuinon yang telah digunakan dalam pengobatan osteoartritis.', 34, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 50, NULL, NULL, NULL, '34-BOCA-0180'),
	(927, 'ORLIBES KAPS', '632', '10500', b'0', 0, 'default_image.png', 'Orlibes merupakan obat yang mengandung orlistat. digunakan untuk membantu menurunkan berat badan pada penderita obesitas dengan cara menghambat enzim lipase di saluran cerna sehingga mengurangi penyerapan lemak dari makanan, dan lemak yang tidak diserap akan dikeluarkan melalui feses.Efek samping yang dapat muncul meliputi feses berminyak, sering buang air besar, nyeri perut, dan penurunan penyerapan vitamin A, D, E, serta K, sehingga disarankan mengonsumsi suplemen multivitamin dua jam sebelum atau sesudah minum obat.', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 34, NULL, NULL, NULL, '24-ORKA-0181'),
	(928, 'LACTALAN 300MG TAB', '442', '3500', b'0', 0, 'default_image.png', 'LACTALAN 300MG KAPSUL memiliki kandungan galatonol yang berfungsi untuk melancarkan Air Susu Ibu (ASI).', 36, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 39, NULL, NULL, NULL, '36-LA30TA-0182'),
	(929, 'MEPROTHION TAB 250MG', '521', '9500', b'0', 0, 'default_image.png', 'Meprothion adalah suplemen untuk membantu menjaga kesehatan tubuh sekaligus mendukung penampilan kulit agar terlihat lebih cerah. Suplemen ini sering dikonsumsi oleh orang yang ingin merawat kulit, mengurangi tanda penuaan dini, atau mempertahankan kesehatan sel tubuh.Meprothion mengandung bahan aktif L-glutathione, yaitu zat antioksidan yang membantu melindungi sel tubuh dari kerusakan akibat radikal bebas. Dengan perlindungan ini, Meprothion dipercaya dapat membantu kulit tetap awet muda, mengurangi keriput, dan menjaga kulit tetap kencang.', 27, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 64, NULL, NULL, NULL, '27-META25-0183'),
	(930, 'COBAZIM 1000 CAP', '189', '7500', b'0', 0, 'default_image.png', 'COBAZIM 1000 MCG KAPSUL adalah sediaan vitamin yang mengandung zat aktif Cobamamide, suatu bentuk koenzim aktif dari Vitamin B12. Berbeda dengan Vitamin B12 biasa (Cyanocobalamin), Cobamamide tidak perlu diubah lagi oleh tubuh dan dapat langsung berperan aktif dalam berbagai proses metabolisme. Dengan perannya dalam metabolisme protein, Cobamamide sering dikaitkan dengan efek positif dalam membantu membangun jaringan tubuh dan merangsang nafsu makan.', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 86, NULL, NULL, NULL, '24-CO10CA-0184'),
	(931, 'GLUCOMEP KAPSUL', '1288', '3000', b'0', 0, 'default_image.png', 'GLUCOMEP digunakan untuk membantu memelihara kesehatan pada penderita diabetes mellitus tipe 2. Glucomep mengandung: Garcinia mangostana pericarpium extract 560 mg Chromium Picolinate 0,1 mg .', 36, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 134, NULL, NULL, NULL, '36-GLKA-0185'),
	(932, 'MOMETASONE CR 0,1%', '550', '31000', b'0', 0, 'default_image.png', 'Mometasone adalah kortikosteroid topikal dengan potensi sedang yang digunakan untuk meredakan manifestasi inflamasi dan pruritus pada dermatosis yang responsif terhadap kortikosteroid, seperti psoriasis dan dermatitis atopik. Aturan PakaiOleskan lapisan tipis sekali sehari pada area kulit yang terkena. Berhenti digunakan ketika kondisi sudah terkendali, atau konsultasikan kembali jika tidak ada perbaikan dalam 2 minggu', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '24-MOCR01-0186'),
	(933, 'HECOSAN SYR 120 ML', '368', '75000', b'0', 0, 'default_image.png', 'Hecosan adalah produk herbal dengan kandungan ekstrak herbal alami. Hecosan digunakan untuk membantu mengurangi batuk berdahak dan membantu melegakan tenggorokan. Hecosan tersedia dalam bentuk sediaan sirup.', 35, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 4, NULL, NULL, NULL, '35-HESY12-0187'),
	(934, 'MADU MURNI NUSANTARA 250ML', '481', '92000', b'0', 0, 'default_image.png', 'Madu murni 100% atau asli tanpa campuran dari lebah lainnya. Keaslian dan kemurnian Madu murni nusantara menimbulkan aroma dan wangi bunga yang sesungguhnya. Dapat dikonsumsi oleh segala usia.Manfaat :Membantu melancarkan peredaran darahMembantu mempertahankan stamina tubuh yang prima.Sumber vitamin yang bergizi tinggi.Mampu menguatkan tulang dan gigi.', 28, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '28-MAMUNU-0188'),
	(935, 'FLUTIVEL NASAL SPRAY', '319', '150000', b'0', 0, 'default_image.png', 'Flutivel Nasal Spray 120 Dosis merupakan obat dengan kandungan zat aktif tiap semprot mengandung Fluticasone Propionate 50 Mikrogram (0,05% b/b) dalam bentuk spray yang mempunyai efek kerja sebagai obat untuk meredakan pembengkakan jaringan yang membuat hidung tersumbat dan menghambat pelepasan zat peradangan yang memicu timbulnya gejala bersin-bersin, mata gatal dan berair, dan hidung meler.', 24, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 1, NULL, NULL, NULL, '24-FLNASP-0189'),
	(936, 'MAMYPOKO PANTS STANDART L 8PC', '492', '25000', b'0', 0, 'default_image.png', 'MAMY POKO PANTS X-TRA KERING L merupakan popok bayi tipe celana dengan ukuran L untuk bayi dengan berat badan sekitar 9-14 kg yang memiliki bantalan X-tra Kering sehingga dapat menyerap cepat dan menyebar pipis ke seluruh bagian popok, sehingga tidak menggumpal dan penahan ganda sehingga mencegah bocor samping.', 28, '2026-01-19 21:01:00', '2026-01-19 22:01:52', 2, NULL, NULL, NULL, '28-MAPAST-0190');
